    it: "ERRORE DEL SERVER. Il tuo studio sembra non essere disponibile (404) sul server Pavlovia. Questo può accadere in diversi modi. Ecco come risolvere il problema:\n1. Potrebbe essersi trattato di un problema momentaneo, ora risolto. Forse Pavlovia ha impiegato molto tempo a rendere disponibile lo studio, oppure si è verificata un'interruzione temporanea dovuta all'elevato traffico del server. Prova ad aggiornare la pagina dello studio cliccando sul pulsante di aggiornamento ↻ nella barra degli indirizzi del browser. Puoi riprovare più volte. Se diventa disponibile, lo studio verrà eseguito normalmente.\n2. In caso contrario, nella pagina del compilatore EasyEyes, clicca sul pulsante \"Vai a Pavlovia\" (in basso a destra della pagina) per aprire la dashboard di Pavlovia per il tuo studio.\n3. Nella dashboard di Pavlovia, assicurati che lo studio sia in modalità \"IN ESECUZIONE\". Se è INATTIVO, premi il pulsante IN ESECUZIONE. Entro due secondi, lo studio passerà alla modalità IN ESECUZIONE e potrà essere eseguito normalmente. Torna alla pagina del compilatore EasyEyes e clicca su ESEGUI, oppure utilizza l'URL dello studio.\n4. Se il tuo studio non disponibile è già in modalità ESEGUI, in genere significa che non hai crediti/licenza per pagare il test online. Ci sono tre modi per procedere.\n5. ESEGUI IL PILOTAGGIO GRATUITO DALLA DASHBOARD DI PAVLOVIA. Se lo desideri, puoi cliccare sul pulsante PILOTAGGIO nella dashboard di Pavlovia per mettere il tuo studio in modalità PILOTAGGIO. Esegui lo studio premendo il pulsante PILOTA (nella dashboard di Pavlovia). È gratuito, ma l'URL dello studio rimane non disponibile.\n6. ESEGUI ONLINE CON CREDITO. Per eseguire online, nella stessa dashboard puoi acquistare crediti da Pavlovia e assegnarne alcuni a questo studio. Ciò consentirà l'esecuzione online dello studio.\n7. ESEGUI ONLINE CON LICENZA. EasyEyes ha una licenza per Pavlovia. Scrivi a denis.pelli@nyu.edu e chiedi che il tuo indirizzo email venga incluso nella licenza del sito EasyEyes Pavlovia. (Oppure, se il tuo istituto ha una licenza del sito Pavlovia, puoi usarla). Fornisci il tuo indirizzo email alla dashboard di Pavlovia per dimostrare di essere in possesso della licenza, che Pavlovia ricorderà nelle sessioni future. Questo permetterà a tutti i tuoi studi di essere svolti online.",
