    fa: '\nخطاي سرور. به نظر مي رسد اين مطالعه بر روي سرور Pavlovia در دسترس نيست (404). دلایل مختلفی می‌تواند موجب این مشکل شود. در اینجا روش‌های حل مشکل آورده شده است:\n1. ممکن است یک مشکل موقتی بوده باشد که اکنون برطرف شده است. شاید Pavlovia در بارگذاری مطالعه دیر عمل کرده  یا قطعی موقتی به دلیل ترافیک زیاد سرور اتفاق افتاده باشد. سعی کنید صفحه اين مطالعه را با کلیک بر روی دکمه ↻ موجود در نوار آدرس مرورگر خود بارگذاری مجدد کنید. می‌توانید چندین بار این کار را امتحان کنید. اگر در دسترس قرار گرفت، مطالعه شما به طور معمول اجرا خواهد شد.\n2. در غیر این صورت، در صفحه کامپایلر EasyEyes، روی دکمه "Go to Pavlovia" (در قسمت پایین سمت راست صفحه) کلیک کنید تا داشبورد Pavlovia برای مطالعه شما باز شود.\n3. در داشبورد Pavlovia، اطمینان حاصل کنید که مطالعه شما در حالت "RUNNING" قرار دارد. اگر در حالت INACTIVE است، دکمه RUNNING را فشار دهید. در عرض دو ثانیه، مطالعه شما به حالت RUNNING تغییر خواهد کرد و اکنون می‌تواند به طور معمول اجرا شود. به صفحه کامپایلر EasyEyes برگردید و دکمه بر روي RUN کلیک کنید یا از URL مطالعه استفاده کنید.\n4. اگر مطالعه غيرقابل دسترس شما در حالت RUNNING قرار دارد. این معمولاً نشان‌دهنده این است که مطالعه شما اعتبار/مجوز لازم برای پرداخت آزمایش آنلاین را ندارد. سه روش برای ادامه کار وجود دارد:\n5. آزمايش اوليه رایگان از داشبورد Pavlovia. اگر تمايل دارید، می‌توانید روی دکمه "آزمايش اوليه" در داشبورد Pavlovia کلیک کنید تا مطالعه شما در حالت آزمايش اوليه قرار گیرد. مطالعه خود را با فشار دادن دکمه PILOT (در داشبورد Pavlovia) اجرا کنید. این رایگان است، اما URL مطالعه شما همچنان در دسترس نخواهد بود.\n6.اجرای آنلاین معتبر: برای اجرای آنلاین، در همان داشبورد می‌توانید اعتبار از Pavlovia خریداری کرده و مقداری از آن را به این مطالعه اختصاص دهید. این به شما اجازه می‌دهد که مطالعه شما به صورت آنلاین اجرا شود.\n7. اجرای آنلاین با مجوز. EasyEyes مجوز سایت برای Pavlovia را دارد. به denis.pelli@nyu.edu ایمیل بزنید و درخواست کنید که ایمیل شما در مجوز سایت EasyEyes برای Pavlovia گنجانده شود. (یا اگر مؤسسه شما مجوز سایت Pavlovia دارد، می‌توانید از آن استفاده کنید.) آدرس ایمیل خود را در داشبورد Pavlovia وارد کنید تا نشان دهید که شما مجوز دارید، که Pavlovia در جلسات آینده آن را به خاطر خواهد سپرد. این امکان را به شما می‌دهد که تمام مطالعات شما آنلاین اجرا شوند.',
