    'zh-CN': 'Loading...',
    'zh-TW': 'Loading...',
    hr: 'VODIČ ZA INSTALIRANJE DYMO PRINTERA NALJEPNICA\nSlijedite ove korake kako biste ovoj studiji pomogli u ispisu naljepnica na vašem DYMO LabelWriter 550.\n① Instalirajte DYMO softver\nPreuzmite i instalirajte najnoviji DYMO softver za svoj OS s DYMO web stranice za podršku:\nhttps://www.dymo.com/support?cfid=user-guide\nU svom pregledniku idite na:\nDYMO.WebApi.Mac.Host:\nProvjerite radi li DYMO.WebApi.Mac.Host.\n② Konfigurirajte svoj preglednik\n▶ Krom\nIdi na:\nkrom://zastave\nPotražite TLS u traci za pretraživanje.\nIz rezultata TLS-a onemogućite:\n⚬ TLS 1.3 Rani podaci\n⚬ Ugovor o postkvantnom ključu TLS 1.3\n⚬ Koristite ML-KEM u TLS 1.3\n⚬ Izostavite TLS klijentske certifikate ako ih način vjerodajnice ne dopušta.\nPritisnite PONOVNO POKRENI na dnu.\n▶ Firefox\nIdite na Postavke → Traži certifikat.\nPoništite opciju "Dopusti Firefoxu da automatski vjeruje korijenskim certifikatima trećih strana..."\nPonovno pokrenite Firefox.\n▶ Safari\nIdi na:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nOdaberite ako se to od vas zatraži\n“Prikaži pojedinosti” → “posjeti ovu web stranicu”\nzaobići sigurnosno upozorenje.\n③ Ispišite naljepnicu\nProvjerite radi li DYMO.WebApi.Mac.Host.\nPritisnite gumb PRINT LABEL na ovoj stranici.\n\nPROBLEM: Ako i dalje ne možete ispisivati, provjerite radi li DYMO.WebApi.Mac.Host ili se obratite službenoj podršci za DYMO.\nOPREZ: ponovno omogućite sve sigurnosne postavke nakon ispisa kako biste održali najvišu zaštitu u svom pregledniku.',
