    fi: 'DYMO LABEL -TULOSTIMEN ASENNUSOPAS\nSeuraa näitä ohjeita auttaaksesi tätä tutkimusta tulostamaan tarroja DYMO LabelWriter 550 -laitteeseen.\n① Asenna DYMO-ohjelmisto\nLataa ja asenna uusin DYMO-ohjelmisto käyttöjärjestelmällesi DYMOn tukisivustolta:\nhttps://www.dymo.com/support?cfid=user-guide\nSiirry selaimessasi osoitteeseen:\nDYMO.WebApi.Mac.Host:\nVarmista, että DYMO.WebApi.Mac.Host on käynnissä.\n② Määritä selaimesi\n▶ Chrome\nSiirry osoitteeseen:\nchrome://liput\nEtsi TLS hakupalkista.\nPoista TLS-tuloksista:\n⚬ TLS 1.3 Early Data\n⚬ Kvanttiavaimen jälkeinen TLS 1.3 -sopimus\n⚬ Käytä ML-KEM:ää TLS 1.3:ssa\n⚬ Jätä TLS-asiakasvarmenteet pois, jos tunnistetila ei salli.\nNapsauta alareunassa KÄYNNISTÄ UUDELLEEN.\n▶ Firefox\nSiirry kohtaan Asetukset → Etsi varmenne.\nPoista valinta "Salli Firefoxin luottaa automaattisesti kolmannen osapuolen juurivarmenteisiin..."\nKäynnistä Firefox uudelleen.\n▶ Safari\nSiirry osoitteeseen:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nValitse pyydettäessä\n"Näytä tiedot" → "käy tällä sivustolla"\nohittaaksesi turvavaroituksen.\n③ Tulosta tarra\nVarmista, että DYMO.WebApi.Mac.Host on käynnissä.\nPaina TULOSTA TARRA -painiketta tällä sivulla.\n\nONGELMA: Jos et edelleenkään voi tulostaa, varmista, että DYMO.WebApi.Mac.Host on käynnissä, tai ota yhteyttä viralliseen DYMO-tukeen.\nVAROITUS: Ota kaikki suojausasetukset uudelleen käyttöön tulostamisen jälkeen, jotta selaimesi suojaus säilyy mahdollisimman korkeana.',
    fr: 'Loading...',
    de: 'DYMO ETIKETTENDRUCKER INSTALLATIONSANLEITUNG\nBefolgen Sie diese Schritte, um diese Studie beim Drucken von Etiketten auf Ihrem DYMO LabelWriter 550 zu unterstützen.\n① DYMO-Software installieren\nLaden Sie die neueste DYMO-Software für Ihr Betriebssystem von der DYMO-Support-Website herunter und installieren Sie sie:\nhttps://www.dymo.com/support?cfid=user-guide\nÖffnen Sie Ihren Browser unter:\nDYMO.WebApi.Mac.Host:\nStellen Sie sicher, dass DYMO.WebApi.Mac.Host ausgeführt wird.\n② Browser konfigurieren\n▶ Chrome\nÖffnen Sie:\nchrome://flags\nSuchen Sie in der Suchleiste nach TLS.\nDeaktivieren Sie in den TLS-Ergebnissen:\n⚬ TLS 1.3 Early Data\n⚬ TLS 1.3 Post-Quantum Key Agreement\n⚬ ML-KEM in TLS 1.3 verwenden\n⚬ TLS-Client-Zertifikate auslassen, wenn der Anmeldeinformationsmodus dies nicht zulässt.\nKlicken Sie unten auf „Neu starten“.\n▶ Firefox\nGehen Sie zu Einstellungen → Zertifikat suchen.\nDeaktivieren Sie „Firefox automatisch Drittanbieter-Stammzertifikaten vertrauen lassen…“\nStarten Sie Firefox neu.\n▶ Safari\nGehen Sie zu:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nWählen Sie bei entsprechender Aufforderung „Details anzeigen“ → „Diese Website besuchen“, um die Sicherheitswarnung zu umgehen.\n③ Etikett drucken\nStellen Sie sicher, dass DYMO.WebApi.Mac.Host ausgeführt wird.\nKlicken Sie auf dieser Seite auf die Schaltfläche ETIKETT DRUCKEN.\n\nPROBLEM: Wenn Sie weiterhin nicht drucken können, stellen Sie sicher, dass DYMO.WebApi.Mac.Host ausgeführt wird, oder wenden Sie sich an den offiziellen DYMO-Support.\nACHTUNG: Aktivieren Sie nach dem Drucken alle Sicherheitseinstellungen erneut, um den größtmöglichen Schutz Ihres Browsers zu gewährleisten.',
