    is: 'UPPSETNINGARHEIÐBÓK fyrir DYMO LABEL PRINTER\nFylgdu þessum skrefum til að hjálpa þessari rannsókn að prenta merkimiða á DYMO LabelWriter 550.\n① Settu upp DYMO hugbúnað\nSæktu og settu upp nýjasta DYMO hugbúnaðinn fyrir stýrikerfið þitt af DYMO stuðningsvefsíðunni:\nhttps://www.dymo.com/support?cfid=user-guide\nÍ vafranum þínum skaltu fara á:\nDYMO.WebApi.Mac.Host:\nGakktu úr skugga um að DYMO.WebApi.Mac.Host sé í gangi.\n② Stilltu vafrann þinn\n▶ Króm\nFarðu á:\nkróm://fánar\nLeitaðu að TLS í leitarstikunni.\nFrá TLS niðurstöðum, slökktu á:\n⚬ TLS 1.3 Snemma gögn\n⚬ TLS 1.3 eftir skammtalyklasamning\n⚬ Notaðu ML-KEM í TLS 1.3\n⚬ Slepptu TLS biðlaravottorðum ef skilríkishamur gerir það ekki.\nSmelltu á RELAUNCH neðst.\n▶ Firefox\nFarðu í Stillingar → Leita að skírteini.\nTaktu hakið úr „Leyfa Firefox að treysta sjálfkrafa rótarvottorðum þriðja aðila...“\nEndurræstu Firefox.\n▶ Safari\nFarðu á:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nEf beðið er um það skaltu velja\n„Sýna upplýsingar“ → „heimsækja þessa vefsíðu“\nað komast framhjá öryggisviðvöruninni.\n③ Prentaðu merkimiða\nGakktu úr skugga um að DYMO.WebApi.Mac.Host sé í gangi.\nÝttu á PRINT LABEL hnappinn á þessari síðu.\n\nVandamál: Ef þú getur enn ekki prentað skaltu staðfesta að DYMO.WebApi.Mac.Host sé í gangi eða ráðfærðu þig við opinberan DYMO stuðning.\nVARÚÐ: Endurvirkjaðu allar öryggisstillingar eftir prentun til að viðhalda sem mestri vernd á vafranum þínum.',
    id: 'Loading...',
    it: 'GUIDA ALL\'INSTALLAZIONE DELLA STAMPANTE DI ETICHETTE DYMO\nSegui questi passaggi per facilitare la stampa di etichette sulla tua DYMO LabelWriter 550.\n① Installa il software DYMO\nScarica e installa la versione più recente del software DYMO per il tuo sistema operativo dal sito web di supporto DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nNel tuo browser, vai a:\nDYMO.WebApi.Mac.Host:\nAssicurati che DYMO.WebApi.Mac.Host sia in esecuzione.\n② Configura il tuo browser\n▶ Chrome\nVai a:\nchrome://flags\nCerca TLS nella barra di ricerca.\nDai risultati TLS, disattiva:\n⚬ Dati iniziali TLS 1.3\n⚬ Accordo chiave post-quantum TLS 1.3\n⚬ Usa ML-KEM in TLS 1.3\n⚬ Ometti i certificati client TLS se la modalità credenziale non lo consente.\nFai clic su RIAVVIA in basso.\n▶ Firefox\nVai su Impostazioni → Cerca certificato.\nDeseleziona "Consenti a Firefox di considerare automaticamente attendibili i certificati radice di terze parti..."\nRiavvia Firefox.\n▶ Safari\nVai su:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nSe richiesto, scegli\n"Mostra dettagli" → "visita questo sito web"\nper ignorare l\'avviso di sicurezza.\n③ Stampa un\'etichetta\nAssicurati che DYMO.WebApi.Mac.Host sia in esecuzione.\nPremi il pulsante STAMPA ETICHETTA in questa pagina.\n\nPROBLEMA: Se ancora non riesci a stampare, verifica che DYMO.WebApi.Mac.Host sia in esecuzione o consulta l\'assistenza ufficiale DYMO.\nATTENZIONE: Riattiva le impostazioni di sicurezza dopo la stampa per mantenere la massima protezione del tuo browser.',
