    tl: 'IYONG iPhone. Kailangan namin ng dalawang detalye na tumutukoy sa modelo ng iyong iPhone. Sa telepono, pumunta sa Mga Setting > Pangkalahatan > Tungkol. \n\n1. MODELONG PANGALAN. Kung gumagamit ito ng iOS 12.2 o mas bago, kopyahin ang Pangalan ng Modelo sa field sa ibaba. Kung gumagamit ito ng mas lumang iOS, tingnan ang LAST RESORT sa ibaba.\n\n2. NATAGO ang "A" NUMBER. Kung nagpapatakbo ka ng iOS 10 o mas bago, ang pag-tap sa Model Number ay magpapakita ng nakatagong "A" na numero: isang "A" na sinusundan ng apat na digit, tulad ng A1234. Kopyahin ang A number sa field sa ibaba. \nKung ito ay iPhone 8 o mas bago, na may SIM tray, alisin ang SIM tray at hanapin ang A number sa slot. Kung walang SIM tray, hanapin ang A number sa Lightning o USB-C connector. Tiyaking nasa lugar ka na may maliwanag na ilaw sa itaas. Ang A number ay nasa itaas na bahagi — ang gilid na may display. Kopyahin ang A number sa field sa ibaba. \nKung ang iPhone ay mas luma kaysa sa iPhone 8, ang A number ay naka-print sa likod bilang isang bagay tulad ng "Model A1234". Kopyahin ang A number sa field sa ibaba. \n\nLAST RESORT. Kung mayroon kang ChapGPT o katumbas, kopyahin ang Numero ng Modelo ng iPhone, hal. MD298HB/A, mula sa pahinang Tungkol dito at tanungin ang ChatGPT para sa pangalan ng modelo at numero nito.',
    tr: 'Loading...',
    ur: 'آپ کا آئی فون۔ ہمیں آپ کے آئی فون کے ماڈل کی وضاحت کرنے والی دو تفصیلات درکار ہیں۔ فون پر، ترتیبات > عمومی > کے بارے میں جائیں۔ \n\n1. ماڈل کا نام۔ اگر یہ iOS 12.2 یا بعد میں چل رہا ہے، تو ماڈل کا نام نیچے کی فیلڈ میں کاپی کریں۔ اگر یہ پرانا iOS چلا رہا ہے تو نیچے آخری ریزورٹ دیکھیں۔\n\n2. چھپا ہوا "A" نمبر۔ اگر آپ iOS 10 یا اس کے بعد کا ورژن چلا رہے ہیں، تو ماڈل نمبر کو ٹیپ کرنے سے پوشیدہ "A" نمبر ظاہر ہو جائے گا: ایک "A" کے بعد چار ہندسے، جیسے A1234۔ A نمبر کو نیچے کی فیلڈ میں کاپی کریں۔ \nاگر یہ آئی فون 8 یا اس کے بعد کا ہے تو، سم ٹرے کے ساتھ، سم ٹرے کو ہٹائیں اور سلاٹ میں A نمبر تلاش کریں۔ اگر کوئی سم ٹرے نہیں ہے، تو لائٹننگ یا USB-C کنیکٹر میں A نمبر تلاش کریں۔ اس بات کو یقینی بنائیں کہ آپ کسی ایسی جگہ پر ہیں جہاں اوپر کی روشنی زیادہ ہے۔ A نمبر اوپری طرف ہے — ڈسپلے کے ساتھ سائیڈ۔ A نمبر کو نیچے کی فیلڈ میں کاپی کریں۔ \nاگر آئی فون آئی فون 8 سے پرانا ہے، تو A نمبر پیچھے پر "Model A1234" کی طرح پرنٹ ہوتا ہے۔ A نمبر کو نیچے کی فیلڈ میں کاپی کریں۔ \n\nآخری حربہ۔ اگر آپ کے پاس ChapGPT یا اس کے مساوی ہے تو آئی فون کا ماڈل نمبر کاپی کریں، جیسے MD298HB/A، اس کے بارے میں صفحہ سے اور ChatGPT سے اس کے ماڈل کا نام اور A نمبر پوچھیں۔',
