    el: 'Loading...',
    he: 'Loading...',
    hi: '1. USB माइक्रोफ़ोन चुनें। अपने माइक्रोफ़ोन के USB-C केबल को इस कंप्यूटर में प्लग करें। कंप्यूटर का ऑडियो कंट्रोल पैनल खोलें।\n        Macintosh: सिस्टम सेटिंग्स > ध्वनि\n    ⊞ Windows: सेटिंग्स > ध्वनि > ध्वनि कंट्रोल पैनल\nइनपुट के रूप में अपना माइक्रोफ़ोन चुनें।\n\n2. सैंपलिंग दर चुनें। UMIK-1 केवल एक सैंपलिंग दर और बिट्स/सैंपल प्रदान करता है, इसलिए सेट करने के लिए कुछ भी नहीं है। UMIK-2 कई प्रदान करता है, जिन्हें आपको किसी ऐप या कंट्रोल पैनल का उपयोग करके सेट करना होगा:\n     Macintosh: Applications/Utilities/ फ़ोल्डर में Apple का Audio MIDI Setup.app।\n       ⊞ Windows: कंट्रोल पैनल > हार्डवेयर और ध्वनि > ऑडियो डिवाइस प्रबंधित करें\nUMIK-2 को [[N11]] Hz पर [[N22]] बिट्स/सैंपल के साथ सैंपल करने के लिए सेट करें। (आप अपने अध्ययन की स्प्रेडशीट में _calibrateSoundSamplingDesiredHz और _calibrateSoundSamplingDesiredBits सेट करके इस प्राथमिकता को बदल सकते हैं।)',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: 'Loading...',
    ja: 'Loading...',
    kn: 'Loading...',
    ko: '1. USB 마이크를 선택하세요. 마이크의 USB-C 케이블을 컴퓨터에 연결하세요. 컴퓨터의 오디오 제어판을 여세요.\n       Macintosh: 시스템 설정 > 사운드\n     ⊞ Windows: 설정 > 사운드 > 사운드 제어판\n마이크를 입력으로 선택하세요.\n\n2. 샘플링 레이트를 선택하세요. UMIK-1은 하나의 샘플링 레이트와 비트/샘플만 제공하므로 별도로 설정할 필요가 없습니다. UMIK-2는 여러 가지 샘플링 레이트와 비트/샘플을 제공하며, 앱이나 제어판을 사용하여 설정해야 합니다.\n      Macintosh: 응용 프로그램/유틸리티/폴더에 있는 Apple의 Audio MIDI Setup.app\n      ⊞ Windows: 제어판 > 하드웨어 및 사운드 > 오디오 장치 관리\nUMIK-2를 [[N11]]Hz, [[N22]]비트/샘플로 샘플링하도록 설정하세요. (연구 스프레드시트에서 _calibrateSoundSamplingDesiredHz와 _calibrateSoundSamplingDesiredBits를 설정하여 이 기본 설정을 변경할 수 있습니다.)',
    lt: '1. PASIRINKITE USB MIKROFONĄ. Prijunkite mikrofono USB-C kabelį prie šio kompiuterio. Atidarykite kompiuterio garso valdymo skydelį. \n      Macintosh: Sistemos nustatymai > Garsas\n     ⊞ „Windows“: Nustatymai > Garsas > Garso valdymo skydelis\nPasirinkite mikrofoną kaip įvestį.  \n\n2. PASIRINKITE MĖGINIŲ ĖMIMO DAŽĄ. UMIK-1 siūlo tik vieną diskretizavimo dažnį ir bitus/sample, todėl nėra ką nustatyti. UMIK-2 siūlo keletą, kuriuos turite nustatyti naudodami programą arba valdymo skydelį:\n      Macintosh: Apple Audio MIDI Setup.app aplanke Applications/Utilities/.\n     ⊞ „Windows“: Valdymo skydas > Aparatūra ir garsas > Tvarkyti garso įrenginius\nNustatykite UMIK-2, kad imtųsi [[N11]] Hz, naudodami [[N22]] bitų per mėginį. (Galite pakeisti šią nuostatą tyrimo skaičiuoklėje nustatydami _calibrateSoundSamplingDesiredHz ir _calibrateSoundSamplingDesiredBits.)',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: '1. انتخاب میکروفون USB:\nکابل USB-C میکروفون خود را به این رایانه وصل کنید. پنل تنظیمات صدای رایانه را باز کنید.\n   مکینتاش: System Settings > Sound\n     ویندوز: Settings > Sound > Sound Control Panel\nمیکروفون خود را به‌عنوان ورودی صدا انتخاب کنید.\n\n2. انتخاب نرخ نمونه‌برداری (Sampling Rate):\nUMIK-1 فقط یک نرخ نمونه‌برداری و تعداد بیت مشخص دارد، بنابراین نیازی به تنظیم ندارد.\nاما UMIK-2 چندین گزینه دارد که باید از طریق یک برنامه یا کنترل پنل تنظیم شود:\n     مکینتاش: برنامه‌ی Audio MIDI Setup در مسیر Applications/Utilities/\n     ویندوز: Control Panel > Hardware and Sound > Manage Audio Devices\nUMIK-2 را روی نرخ نمونه‌برداری [[N11]] هرتز و [[N22]] بیت در هر نمونه تنظیم کنید.\n(شما می‌توانید این ترجیحات را با تنظیم مقادیر _calibrateSoundSamplingDesiredHz و _calibrateSoundSamplingDesiredBits در فایل اکسل مطالعه خود تغییر دهید.)',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: 'Loading...',
    sw: 'Loading...',
    sv: 'Loading...',
    tl: '1. PUMILI NG USB MICROPHONE. Isaksak ang USB-C cable ng iyong mikropono sa computer na ito. Buksan ang audio control panel ng computer. \n      Macintosh: Mga Setting ng System > Tunog\n     ⊞ Windows: Mga Setting > Tunog > Sound Control Panel\nPiliin ang iyong mikropono bilang input.  \n\n2. PUMILI NG SAMPLING RATE. Ang UMIK-1 ay nag-aalok lamang ng isang sampling rate at bits/sample, kaya walang dapat itakda. Nag-aalok ang UMIK-2 ng ilan, na dapat mong itakda gamit ang isang app o control panel:\n      Macintosh: Audio MIDI Setup.app ng Apple sa Applications/Utilities/ folder.\n     ⊞ Windows: Control Panel > Hardware at Sound > Pamahalaan ang Mga Audio Device\nItakda ang UMIK-2 sa sample sa [[N11]] Hz na may [[N22]] bits/sample. (Maaari mong baguhin ang kagustuhang ito sa pamamagitan ng pagtatakda ng _calibrateSoundSamplingDesiredHz at _calibrateSoundSamplingDesiredBits sa spreadsheet ng iyong pag-aaral.)',
