    he: 'בחר קצב דגימה וביטים לדגימה (לינוקס: PulseAudio או PipeWire)\n\nאנא הגדר את התקן קלט השמע שלך (UMIK-2) באמצעות ההוראות שלהלן כדי לוודא שהוא תואם להגדרות הנדרשות:\nקצב דגימה: [[N11]] הרץ\nביטים לדגימה: [[N22]]-bit\n1. פתח את PulseAudio Control Volume (`pavucontrol`) או את אפליקציית הגדרות השמע שלך.\n2. בחר את המכשיר שלך (UMIK-2) בכרטיסייה **התקני קלט**.\n3. ערוך את `/etc/pulse/daemon.conf`:\n   - `default-sample-rate = [[N11]]`\n   - `default-sample-format = s[[N22]]le`\n4. הפעל מחדש את PulseAudio:\n   `pulsaudio -k && pulsaudio --start`\n5. אשר את קצב הדגימה בכרטיסייה **הקלטה** או באמצעות:\n   `arecord -f S[[N22]]_LE -r [[N11]] -D plughw:UMIK2 test.wav`\n\nלאחר ההגדרה, חזור לדף אינטרנט זה ולחץ על המשך או הקש על RETURN.\n\n(קצב הדגימה ועומק הסיביות הנדרשים נקבעים על ידי הפרמטרים _calibrateSoundSamplingDesiredHz ו-_calibrateSoundSamplingDesiredBits בגיליון האלקטרוני של המחקר.)',
    hi: 'Loading...',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: 'Loading...',
    ja: 'Loading...',
    kn: 'ಪ್ರತಿ ಮಾದರಿಗೆ ಮಾದರಿ ದರ ಮತ್ತು ಬಿಟ್‌ಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ (ಲಿನಕ್ಸ್: ಪಲ್ಸ್ ಆಡಿಯೋ ಅಥವಾ ಪೈಪ್‌ವೈರ್)\n\nದಯವಿಟ್ಟು ನಿಮ್ಮ ಆಡಿಯೊ ಇನ್‌ಪುಟ್ ಸಾಧನವನ್ನು (UMIK-2) ಕಾನ್ಫಿಗರ್ ಮಾಡಿ ಕೆಳಗಿನ ಸೂಚನೆಗಳನ್ನು ಬಳಸಿಕೊಂಡು ಅದು ಅಗತ್ಯವಿರುವ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗೆ ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ:\nಮಾದರಿ ದರ: [[N11]] Hz\nಪ್ರತಿ ಮಾದರಿಗೆ ಬಿಟ್‌ಗಳು: [[N22]]-ಬಿಟ್\n1. PulseAudio Volume Control (`pavucontrol`) ಅಥವಾ ನಿಮ್ಮ ಆಡಿಯೋ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಅಪ್ಲಿಕೇಶನ್ ತೆರೆಯಿರಿ.\n2. **ಇನ್‌ಪುಟ್ ಸಾಧನಗಳು** ಟ್ಯಾಬ್‌ನ ಅಡಿಯಲ್ಲಿ ನಿಮ್ಮ ಸಾಧನವನ್ನು (UMIK-2) ಆಯ್ಕೆಮಾಡಿ.\n3. ಸಂಪಾದಿಸಿ `/etc/pulse/daemon.conf`:\n   - `ಡೀಫಾಲ್ಟ್-ಮಾದರಿ ದರ = [[N11]]`\n   - `ಡೀಫಾಲ್ಟ್-ಮಾದರಿ-ಫಾರ್ಮ್ಯಾಟ್ = s[[N22]]le`\n4. ಪಲ್ಸ್ ಆಡಿಯೊವನ್ನು ಮರುಪ್ರಾರಂಭಿಸಿ:\n   `ಪಲ್ಸಿಯೋಡಿಯೋ -ಕೆ && ಪಲ್ಸ್ ಆಡಿಯೋ --ಸ್ಟಾರ್ಟ್`\n5. **ರೆಕಾರ್ಡಿಂಗ್** ಟ್ಯಾಬ್‌ನಲ್ಲಿ ಅಥವಾ ಇದರೊಂದಿಗೆ ಮಾದರಿ ದರವನ್ನು ದೃಢೀಕರಿಸಿ:\n   `arecord -f S[[N22]]_LE -r [[N11]] -D plughw:UMIK2 test.wav`\n\nಒಮ್ಮೆ ಕಾನ್ಫಿಗರ್ ಮಾಡಿದ ನಂತರ, ಈ ವೆಬ್ ಪುಟಕ್ಕೆ ಹಿಂತಿರುಗಿ ಮತ್ತು ಮುಂದುವರಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ ಅಥವಾ ರಿಟರ್ನ್ ಒತ್ತಿರಿ.\n\n(ಅಗತ್ಯವಿರುವ ಮಾದರಿ ದರ ಮತ್ತು ಬಿಟ್ ಆಳವನ್ನು ಅಧ್ಯಯನ ಸ್ಪ್ರೆಡ್‌ಶೀಟ್‌ನಲ್ಲಿ _calibrateSoundSamplingDesiredHz ಮತ್ತು _calibrateSoundSamplingDesiredBits ನಿಯತಾಂಕಗಳಿಂದ ಹೊಂದಿಸಲಾಗಿದೆ.)',
    ko: '샘플링 레이트 및 샘플당 비트 수 선택(Linux: PulseAudio 또는 PipeWire)\n\n아래 지침에 따라 오디오 입력 장치(UMIK-2)를 구성하여 필요한 설정과 일치하는지 확인하세요.\n샘플링 레이트: [[N11]]Hz\n샘플당 비트 수: [[N22]]-비트\n1. PulseAudio 볼륨 컨트롤(`pavucontrol`) 또는 오디오 설정 애플리케이션을 엽니다.\n2. **입력 장치** 탭에서 장치(UMIK-2)를 선택합니다.\n3. `/etc/pulse/daemon.conf`를 편집합니다.\n- `default-sample-rate = [[N11]]`\n- `default-sample-format = s[[N22]]le`\n4. PulseAudio를 다시 시작합니다.\n`pulseaudio -k && pulseaudio --start`\n5. **녹음** 탭 또는 다음 명령어를 사용하여 샘플링 속도를 확인합니다.\n`arecord -f S[[N22]]_LE -r [[N11]] -D plughw:UMIK2 test.wav`\n\n구성이 완료되면 이 웹 페이지로 돌아와 "진행"을 클릭하거나 "돌아가기"를 누릅니다.\n\n(필요한 샘플링 속도와 비트 심도는 연구 스프레드시트의 _calibrateSoundSamplingDesiredHz 및 _calibrateSoundSamplingDesiredBits 매개변수에 의해 설정됩니다.)',
    lt: 'PASIRINKITE ATĖMIMO DAŽĄ IR BITUS VIENAM MĖGINIUI („Linux“: „PulseAudio“ arba „PipeWire“)\n\nSukonfigūruokite garso įvesties įrenginį (UMIK-2) vadovaudamiesi toliau pateiktomis instrukcijomis, kad įsitikintumėte, jog jis atitinka reikiamus nustatymus:\nAtrankos dažnis: [[N11]] Hz\nBitai mėginiui: [[N22]] bitai\n1. Atidarykite „PulseAudio Volume Control“ („pavucontrol“) arba garso nustatymų programą.\n2. Skirtuke **Įvesties įrenginiai** pasirinkite įrenginį (UMIK-2).\n3. Redaguokite „/etc/pulse/daemon.conf“:\n   - „numatytasis atrankos dažnis = [[N11]]“.\n   - `default-sample-format = s[[N22]]le`\n4. Iš naujo paleiskite PulseAudio:\n   "pulseaudio -k && pulseaudio --start".\n5. Patvirtinkite atrankos dažnį skirtuke **Įrašymas** arba naudodami:\n   "arecord -f S[[N22]]_LE -r [[N11]] -D plughw:UMIK2 test.wav"\n\nSukonfigūravę grįžkite į šį tinklalapį ir spustelėkite Tęsti arba paspauskite GRĮŽTI.\n\n(Reikalingas atrankos dažnis ir bitų gylis nustatomi tyrimo skaičiuoklės parametrais _calibrateSoundSamplingDesiredHz ir _calibrateSoundSamplingDesiredBits.)',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: 'انتخاب نرخ نمونه‌برداری و بیت در هر نمونه (Linux: PulseAudio یا PipeWire)\n\nلطفاً دستگاه ورودی صدای خود (UMIK-2) را طبق دستورالعمل زیر پیکربندی کنید تا با تنظیمات مورد نیاز مطابقت داشته باشد:\nنرخ نمونه‌برداری (Sampling Rate): [[N11]] هرتز\nبیت در هر نمونه (Bits per Sample): [[N22]]-بیت\n\n۱. برنامه PulseAudio Volume Control (pavucontrol) یا برنامه تنظیمات صدای سیستم را باز کنید.\n۲. در تب Input Devices، دستگاه خود (UMIK-2) را انتخاب کنید.\n۳. فایل تنظیمات /etc/pulse/daemon.conf را ویرایش کنید و خطوط زیر را اضافه یا اصلاح نمایید:\n - default-sample-rate = [[N11]]\n - default-sample-format = s[[N22]]le\n۴. PulseAudio را بازنشانی کنید با اجرای دستور:\n pulseaudio -k && pulseaudio --start\n۵. نرخ نمونه‌برداری را در تب Recording بررسی کنید یا از دستور زیر استفاده کنید:\n arecord -f S[[N22]]_LE -r [[N11]] -D plughw:UMIK2 test.wav\n\nپس از انجام تنظیمات، به این صفحه وب بازگردید و روی ادامه (PROCEED) کلیک کنید یا کلید بازگشت (RETURN) را فشار دهید.\n\n(نرخ نمونه‌برداری و عمق بیت موردنیاز توسط پارامترهای _calibrateSoundSamplingDesiredHz و _calibrateSoundSamplingDesiredBits در فایل اکسل مطالعه تعیین شده‌اند.)"',
