    fa: 'انتخاب نرخ نمونه‌برداری و بیت در هر نمونه (Chrome OS)\n\nلطفاً دستگاه ورودی صدای خود (UMIK-2) را طبق دستورالعمل زیر پیکربندی کنید تا با تنظیمات مورد نیاز مطابقت داشته باشد:\nنرخ نمونه‌برداری (Sampling Rate): [[N11]] هرتز\nبیت در هر نمونه (Bits per Sample): [[N22]]-بیت\n\nبرخلاف macOS یا Windows، سیستم‌عامل Chrome OS ابزار داخلی برای تنظیم نرخ نمونه‌برداری یا عمق بیت ندارد. این سیستم‌عامل به تنظیمات پیش‌فرض ارائه‌شده توسط دستگاه صوتی متصل‌شده تکیه دارد. توصیه می‌شود میکروفون UMIK-2 خود را ابتدا روی سیستمی سازگار (مانند macOS یا Windows) پیکربندی کرده و سپس به Chromebook متصل کنید.\n\nپس از انجام تنظیمات، به این صفحه وب بازگردید و روی ادامه (PROCEED) کلیک کنید یا کلید بازگشت (RETURN) را فشار دهید.\n\n(نرخ نمونه‌برداری و عمق بیت موردنیاز توسط پارامترهای _calibrateSoundSamplingDesiredHz و _calibrateSoundSamplingDesiredBits در فایل اکسل مطالعه تعیین شده‌اند.)',
