    tr: "ÖRNEKLEME HIZINI VE ÖRNEK BAŞINA BİTLERİ SEÇİN (Chrome OS)\n\nLütfen gerekli ayarlarla eşleştiğinden emin olmak için ses giriş cihazınızı (UMIK-2) aşağıdaki talimatları kullanarak yapılandırın:\nÖrnekleme Hızı: [[N11]] Hz\nÖrnek Başına Bit: [[N22]]-bit\n\nmacOS veya Windows'un aksine, Chrome OS'de örnekleme hızını veya bit derinliğini ayarlamak için yerleşik yardımcı programlar bulunmaz. Bağlı ses cihazı tarafından sağlanan varsayılan yapılandırmalara dayanır. UMIK-2 mikrofonunuzu Chromebook'unuza bağlamadan önce uyumlu bir sistemde (örneğin macOS veya Windows) önceden yapılandırmanız önerilir.\n\nYapılandırdıktan sonra bu web sayfasına geri dönün ve DEVAM ET'e tıklayın veya GERİ DÖN'e basın.\n\n(Gerekli örnekleme hızı ve bit derinliği, çalışma elektronik tablosundaki _calibrateSoundSamplingDesiredHz ve _calibrateSoundSamplingDesiredBits parametreleriyle ayarlanır.)",
