    fa: 'راهنمای نصب چاپگر DYMO LABEL\nبرای کمک به این مطالعه جهت چاپ برچسب با چاپگر DYMO LabelWriter 550، مراحل زیر را دنبال کنید.\n\n① نرم‌افزار DYMO را نصب کنید\nآخرین نسخه نرم‌افزار DYMO را متناسب با سیستم‌عامل خود از وب‌سایت پشتیبانی DYMO دانلود و نصب کنید:\nhttps://www.dymo.com/support?cfid=user-guide\nدر مرورگر خود به آدرس زیر بروید:\nDYMO.WebApi.Mac.Host\nاطمینان حاصل کنید که DYMO.WebApi.Mac.Host در حال اجرا است.\n\n② مرورگر خود را پیکربندی کنید\n\n▶ Chrome\nبه آدرس زیر بروید:\nchrome://flags\nدر نوار جستجو، عبارت TLS را جستجو کنید.\nاز نتایج TLS، موارد زیر را غیرفعال کنید:\n⚬ TLS 1.3 Early Data\n⚬ TLS 1.3 post-quantum key agreement\n⚬ Use ML-KEM in TLS 1.3\n⚬ Omit TLS client certificates if credential mode disallows\nدر پایین صفحه روی RELAUNCH کلیک کنید.\n\n▶ Firefox\nبه Settings بروید → عبارت Certificate را جستجو کنید.\nتیک گزینه‌ی\n“Allow Firefox to automatically trust third-party root certificates...”\nرا بردارید.\nمرورگر Firefox را مجدداً راه‌اندازی کنید.\n\n▶ Safari\nبه آدرس زیر بروید:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nدر صورت درخواست، گزینه‌ی\n“Show Details” → “visit this website”\nرا انتخاب کنید تا هشدار امنیتی را دور بزنید.\n\n③ یک برچسب چاپ کنید\nمطمئن شوید که DYMO.WebApi.Mac.Host در حال اجرا است.\nروی دکمه PRINT LABEL در این صفحه کلیک کنید.\n\nمشکل: اگر هنوز نمی‌توانید چاپ کنید، بررسی کنید که DYMO.WebApi.Mac.Host در حال اجرا باشد یا با پشتیبانی رسمی DYMO مشورت کنید.\nهشدار: پس از چاپ، تنظیمات امنیتی مرورگر خود را دوباره فعال کنید تا حداکثر حفاظت حفظ شود.',
    pl: 'Loading...',
