    ro: 'GHID DE INSTALARE A IMPRIMANTEI DE ETICHETE DYMO\nUrmați acești pași pentru a ajuta acest studiu să imprime etichete pe DYMO LabelWriter 550.\n① Instalați software-ul DYMO\nDescărcați și instalați cel mai recent software DYMO pentru sistemul dvs. de operare de pe site-ul web de asistență DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nÎn browser, accesați:\nDYMO.WebApi.Mac.Host:\nAsigurați-vă că DYMO.WebApi.Mac.Host rulează.\n② Configurați-vă browserul\n▶ Crom\nAccesați:\nchrome://steaguri\nCăutați TLS în bara de căutare.\nDin rezultatele TLS, dezactivați:\n⚬ TLS 1.3 Date timpurii\n⚬ Acord de cheie post-cuantică TLS 1.3\n⚬ Utilizați ML-KEM în TLS 1.3\n⚬ Omiteți certificatele client TLS dacă modul de autentificare nu permite.\nFaceți clic pe RELANSARE în partea de jos.\n▶ Firefox\nAccesați Setări → Căutați certificat.\nDebifați „Permiteți ca Firefox să aibă încredere automat în certificatele rădăcină terță parte...”\nReporniți Firefox.\n▶ Safari\nAccesați:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nDacă vi se solicită, alegeți\n„Afișați detalii” → „vizitați acest site web”\npentru a ocoli avertismentul de securitate.\n③ Imprimați o etichetă\nAsigurați-vă că DYMO.WebApi.Mac.Host rulează.\nApăsați butonul PRINT LABEL din această pagină.\n\nPROBLEMĂ: Dacă tot nu puteți imprima, confirmați că DYMO.WebApi.Mac.Host rulează sau consultați asistența oficială DYMO.\nATENȚIE: Reactivați toate setările de securitate după imprimare pentru a menține cea mai înaltă protecție a browserului dvs.',
    ru: 'Loading...',
    sr: 'ВОДИЧ ЗА ИНСТАЛАЦИЈУ ДИМО ШТАМПАЧА НАЉЕПНИЦА\nПратите ове кораке да бисте помогли у овој студији да штампа налепнице на вашем ДИМО ЛабелВритер 550.\n① Инсталирајте ДИМО софтвер\nПреузмите и инсталирајте најновији ДИМО софтвер за ваш ОС са ДИМО веб локације за подршку:\nхттпс://ввв.димо.цом/суппорт?цфид=усер-гуиде\nУ свом претраживачу идите на:\nДИМО.ВебАпи.Мац.Хост:\nУверите се да је ДИМО.ВебАпи.Мац.Хост покренут.\n② Конфигуришите свој претраживач\n▶ Цхроме\nИди на:\nцхроме://флагс\nПотражите ТЛС у траци за претрагу.\nИз ТЛС резултата онемогућите:\n⚬ ТЛС 1.3 Рани подаци\n⚬ ТЛС 1.3 пост-квантни кључни споразум\n⚬ Користите МЛ-КЕМ у ТЛС 1.3\n⚬ Изоставите ТЛС клијентске сертификате ако режим акредитива не дозвољава.\nКликните на РЕЛАУНЦХ на дну.\n▶ Фирефок\nИдите на Подешавања → Потражите сертификат.\nОпозовите избор опције „Дозволи Фирефоку да аутоматски верује коренским сертификатима трећих страна...“\nПоново покрените Фирефок.\n▶ Сафари\nИди на:\nхттпс://127.0.0.1:41951/ДИМО/ДЛС/Принтинг/СтатусЦоннецтед\nАко се то од вас затражи, изаберите\n„Прикажи детаље“ → „посетите ову веб локацију“\nда заобиђе безбедносно упозорење.\n③ Одштампајте налепницу\nУверите се да је ДИМО.ВебАпи.Мац.Хост покренут.\nПритисните дугме ПРИНТ ЛАБЕЛ на овој страници.\n\nПРОБЛЕМ: Ако и даље не можете да штампате, потврдите да је ДИМО.ВебАпи.Мац.Хост покренут или консултујте званичну ДИМО подршку.\nОПРЕЗ: Поново омогућите све безбедносне поставке након штампања да бисте одржали највишу заштиту вашег претраживача.',
