    tr: "DYMO ETİKET YAZICI KURULUM KILAVUZU\nBu çalışmanın DYMO LabelWriter 550 cihazınızda etiket yazdırmasına yardımcı olmak için aşağıdaki adımları izleyin.\n① DYMO Yazılımını Kurun\nİşletim sisteminiz için en son DYMO yazılımını DYMO destek web sitesinden indirin ve kurun:\nhttps://www.dymo.com/support?cfid=user-guide\nTarayıcınızda şuraya gidin:\nDYMO.WebApi.Mac.Host:\nDYMO.WebApi.Mac.Host'un çalıştığından emin olun.\n② Tarayıcınızı Yapılandırın\n▶ Chrome\nŞuraya gidin:\nchrome://flags\nArama çubuğunda TLS'yi arayın.\nTLS sonuçlarından şunları devre dışı bırakın:\n⚬ TLS 1.3 Erken Veri\n⚬ TLS 1.3 Kuantum Sonrası Anahtar Anlaşması\n⚬ TLS 1.3'te ML-KEM Kullan\n⚬ Kimlik bilgisi modu izin vermiyorsa TLS istemci sertifikalarını atla.\nAlttaki YENİDEN BAŞLAT'a tıklayın.\n▶ Firefox\nAyarlar → Sertifika Ara'ya gidin.\n\"Firefox'un üçüncü taraf kök sertifikalarına otomatik olarak güvenmesine izin ver...\" seçeneğinin işaretini kaldırın.\nFirefox'u yeniden başlatın.\n▶ Safari\nŞu adrese gidin:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nİstenirse, güvenlik uyarısını atlamak için\n\"Ayrıntıları Göster\" → \"bu web sitesini ziyaret et\"\nseçeneğini belirleyin.\n③ Etiket Yazdır\nDYMO.WebApi.Mac.Host'un çalıştığından emin olun.\nBu sayfadaki ETİKET YAZDIR düğmesine basın.\n\nSORUN: Hala yazdıramıyorsanız, DYMO.WebApi.Mac.Host'un çalıştığını doğrulayın veya resmi DYMO destek ekibine danışın.\nDİKKAT: Tarayıcınızda en yüksek korumayı sağlamak için yazdırdıktan sonra tüm güvenlik ayarlarını yeniden etkinleştirin.",
