    ml: 'Loading...',
    no: 'Loading...',
    fa: 'Loading...',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: '1. Utilizați un ecran care are o cameră încorporată în partea de sus.\n2. Dacă aceasta nu o face, trageți această fereastră pe un ecran care o face.\n3. Micșorați fereastra pentru a ușura tragerea.\n4. Odată ce este pe ecranul din dreapta, faceți clic pe PROCES sau apăsați RETURN.\n\nASIGURAREA CONFIDENTIALITATII CAMERA\nCamera web nu este niciodată înregistrată. Fiecare cadru este procesat numai pe computerul dvs., doar pentru a estima poziția ochilor și privirii, apoi este șters în 10 secunde. Sunt salvate doar pozițiile calculate ale ochilor și privirii.',
    ru: '1. Используйте экран со встроенной камерой в верхней части экрана.\n2. Если этого нет, перетащите это окно на экран с камерой.\n3. Уменьшите размер окна, чтобы облегчить перетаскивание.\n4. Когда оно окажется на нужном экране, нажмите «ПРОДОЛЖИТЬ» или «ВОЗВРАТ».\n\nГАРАНТИЯ КОНФИДЕНЦИАЛЬНОСТИ КАМЕРЫ\nВаша веб-камера никогда не записывается. Каждый кадр обрабатывается только на вашем компьютере для оценки положения глаз и взгляда, а затем удаляется в течение 10 секунд. Сохраняются только рассчитанные положения глаз и взгляда.',
    sr: '1. Користите екран који има уграђену камеру на врху.\n2. Ако овај није, превуците овај прозор на екран који јесте.\n3. Смањите прозор да бисте олакшали превлачење.\n4. Када се појави на десном екрану, кликните на ПРОЦЕЕД или притисните РЕТУРН.\n\nОСИГУРАЊЕ ПРИВАТНОСТИ КАМЕРОМ\nВаша веб камера се никада не снима. Сваки оквир се обрађује само на вашем рачунару, само да би се проценио положај очију и погледа, а затим се брише у року од 10 секунди. Чувају се само израчунати положаји очију и погледа.',
