    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: 'Loading...',
    ja: '1. 長くて日常的に使う物を選びましょう。画面の対角線までの長さがあれば、なお良いでしょう。定規、本、雑誌、丸めた紙、ボトル、背の高いグラス、木のスプーン、ひもなどが適しています。緊急の場合は携帯電話やリモコンでも代用できますが、長めのものの方が簡単です。\n2. 鉛筆のような鋭利なものは避けてください。\n3. 下の黄色いテープを使って長さを測ります。\n4. テープに物を当て、一直線になるようにします。\n5. まず左端を合わせ、次にドラッグするか、◀▶キーを使って右端を合わせます。\n6. スペースキーを押して続行します。',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: 'Loading...',
    ml: '1. ദൈർഘ്യമേറിയതും ദൈനംദിനവുമായ ഒരു ഒബ്‌ജക്റ്റ് തിരഞ്ഞെടുക്കുക- ദൈർഘ്യമേറിയതാണ് നല്ലത് (നിങ്ങളുടെ സ്‌ക്രീനിൻ്റെ ഡയഗണൽ വരെ). നല്ല ഓപ്ഷനുകളിൽ ഒരു ഭരണാധികാരി, പുസ്തകം, മാസിക, ചുരുട്ടിയ കടലാസ്, കുപ്പി, ഉയരമുള്ള ഗ്ലാസ്, മരം സ്പൂൺ അല്ലെങ്കിൽ ചരട് എന്നിവ ഉൾപ്പെടുന്നു. ഒരു ഫോണോ റിമോട്ടോ ഒരു പിഞ്ചിൽ പ്രവർത്തിക്കും, എന്നാൽ ദൈർഘ്യമേറിയ എന്തെങ്കിലും അത് എളുപ്പമാക്കുന്നു.\n2. പെൻസിൽ പോലുള്ള മൂർച്ചയുള്ള വസ്തുക്കൾ ഒഴിവാക്കുക.\n3. അതിൻ്റെ നീളം അളക്കാൻ താഴെയുള്ള മഞ്ഞ ടേപ്പ് ഉപയോഗിക്കുക:\n4. നിങ്ങളുടെ ഒബ്‌ജക്‌റ്റ് ടേപ്പിന് നേരെ പിടിക്കുക, അത് വിന്യസിച്ചിരിക്കുന്നു.\n5. ആദ്യം ഇടത് അറ്റത്ത് വരയ്ക്കുക, തുടർന്ന് വലത് അറ്റവുമായി പൊരുത്തപ്പെടുന്നതിന് ◀ ▶ കീകൾ വലിച്ചിടുക അല്ലെങ്കിൽ ഉപയോഗിക്കുക.\n6. തുടരാൻ SPACE അമർത്തുക.',
    no: '1. Velg en lang, hverdagslig gjenstand – jo lengre jo bedre (opp til diagonalen på skjermen). Gode ​​alternativer inkluderer en linjal, bok, magasin, sammenrullet stykke papir, flaske, høyt glass, treskje eller hyssing. En telefon eller fjernkontroll vil fungere på et blunk, men noe lengre gjør det enklere.\n2. Unngå skarpe gjenstander som blyanter.\n3. Bruk det gule båndet nedenfor for å måle lengden:\n4. Hold gjenstanden mot tapen, hold den på linje.\n5. Still først den venstre enden, dra eller bruk ◀ ▶-tastene for å matche den høyre enden.\n6. Trykk MELLOMROM for å fortsette.',
    fa: 'Loading...',
    pl: 'Loading...',
    pt: '1. Escolha um objeto longo e cotidiano — quanto maior, melhor (até a diagonal da tela). Boas opções incluem uma régua, um livro, uma revista, um pedaço de papel enrolado, uma garrafa, um copo alto, uma colher de pau ou um barbante. Um telefone ou controle remoto funcionam em caso de emergência, mas algo mais longo facilita.\n2. Evite objetos pontiagudos, como lápis.\n3. Use a fita amarela abaixo para medir o comprimento:\n4. Segure o objeto contra a fita, mantendo-o alinhado.\n5. Primeiro, alinhe a extremidade esquerda e, em seguida, arraste ou use as teclas ◀ ▶ para alinhar a extremidade direita.\n6. Pressione a barra de espaço para continuar.',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: '1. Elige un objeto largo y cotidiano; cuanto más largo, mejor (hasta la diagonal de la pantalla). Algunas buenas opciones incluyen una regla, un libro, una revista, un trozo de papel enrollado, una botella, un vaso alto, una cuchara de madera o una cuerda. Un teléfono o un control remoto funcionarán en caso de apuro, pero algo más largo lo hace más fácil.\n2. Evita objetos afilados como lápices.\n3. Usa la cinta amarilla de abajo para medir su longitud:\n\n4. Sostén el objeto contra la cinta, manteniéndolo alineado.\n\n5. Primero, alinea el extremo izquierdo y luego arrastra o usa las teclas ◀ ▶ para que coincida con el extremo derecho.\n\n6. Pulsa la barra espaciadora para continuar.',
