    fr: "1. Trouvez votre webcam, généralement en haut au centre de l'écran (avec une petite lumière blanche ou verte).\n2. Dans les étapes suivantes, vous demanderez à la webcam de prendre une photo de votre visage, simplement pour mesurer votre distance.\n• La photo est immédiatement effacée.\n• Pour mesurer la distance, la photo doit inclure vos yeux et votre menton.\n• Concentrez-vous sur votre distance au moment de la photo.\n3. Tenez l'objet de mesure avec une extrémité touchant l'écran, près de la webcam, et l'autre touchant votre visage, près de votre œil.\n4. Penchez-vous jusqu'à ce que la distance entre votre œil et votre webcam corresponde à la longueur de l'objet.\n5. Figez-vous dans cette position, découvrez votre visage, puis appuyez sur ESPACE pour prendre la photo.",
    de: 'Loading...',
    el: '1. Βρείτε την κάμερα web, συνήθως στο επάνω κέντρο της οθόνης (με ένα μικρό λευκό ή πράσινο φως).\n2. Στα παρακάτω βήματα, θα ζητήσετε από την κάμερα web να τραβήξει μια φωτογραφία του προσώπου σας, απλώς για να μετρήσει την απόστασή σας. \n    • Η εικόνα διαγράφεται αμέσως μετά.\n    • Για να μετρήσετε την απόσταση, το στιγμιότυπο πρέπει να περιλαμβάνει τα μάτια και το πηγούνι σας.\n    • Εστιάστε στην απόστασή σας τη στιγμή του στιγμιότυπου.\n3. Κρατήστε το αντικείμενο μέτρησης με το ένα άκρο να αγγίζει την οθόνη, κοντά στην κάμερα web και το άλλο να αγγίζει το πρόσωπό σας, κοντά στο μάτι σας.\n4. Γείρετε προς τα μέσα έως ότου η απόσταση μεταξύ των ματιών και της κάμερας web να ταιριάζει με το μήκος του αντικειμένου.\n5. Παγώστε σε αυτή τη θέση, ξεσκεπάστε το πρόσωπό σας και, στη συνέχεια, πατήστε SPACE για να τραβήξετε το στιγμιότυπο.',
