    pl: '1. Znajdź kamerę internetową, zazwyczaj w górnej środkowej części ekranu (z małą białą lub zieloną diodą).\n2. W poniższych krokach poprosisz kamerę internetową o zrobienie zdjęcia Twojej twarzy, aby zmierzyć odległość.\n• Zdjęcie zostanie natychmiast usunięte.\n• Aby zmierzyć odległość, zdjęcie musi obejmować Twoje oczy i brodę.\n• Skoncentruj się na odległości w momencie robienia zdjęcia.\n3. Trzymaj obiekt pomiarowy jednym końcem dotykając ekranu, blisko kamery internetowej, a drugim dotykając twarzy, blisko oka.\n4. Pochyl się, aż odległość między okiem a kamerą internetową zrówna się z długością obiektu.\n5. Zastygnij w tej pozycji, odsłonij twarz, a następnie naciśnij SPACJĘ, aby zrobić zdjęcie.',
    pt: 'Loading...',
