    ru: '1. Найдите веб-камеру, обычно в верхней центральной части экрана (с небольшим белым или зелёным индикатором).\n2. На следующих этапах вам нужно будет попросить веб-камеру сделать снимок вашего лица, чтобы измерить расстояние.\n• Изображение сразу же сотрётся.\n• Для измерения расстояния снимок должен включать ваши глаза и подбородок.\n• Сфокусируйтесь на расстоянии в момент снимка.\n3. Держите измерительный объект так, чтобы один его конец касался экрана рядом с веб-камерой, а другой — вашего лица рядом с глазом.\n4. Наклонитесь вперёд, пока расстояние от глаз до веб-камеры не совпадёт с длиной объекта.\n5. Замрите в этом положении, откройте лицо и нажмите ПРОБЕЛ, чтобы сделать снимок.',
    sr: 'Loading...',
    es: 'Loading...',
    sw: '1. Tafuta kamera yako ya wavuti, kwa kawaida kwenye sehemu ya juu ya skrini (iliyo na mwanga mdogo mweupe au kijani).\n2. Katika hatua zifuatazo, utaomba kamera ya wavuti ipige picha ya uso wako, ili tu kupima umbali wako. \n    • Picha inafutwa mara baada ya.\n    • Ili kupima umbali, picha lazima iwe na macho na kidevu chako.\n    • Zingatia umbali wako wakati wa kupiga picha.\n3. Shikilia kifaa cha kupimia kwa ncha moja ukigusa skrini, karibu na kamera ya wavuti, na nyingine ukigusa uso wako, karibu na jicho lako.\n4. Sogea hadi umbali wako wa jicho-kwa-kamera ulingane na urefu wa kitu.\n5. Igandishe katika nafasi hiyo, funua uso wako, kisha uguse SPACE ili kupiga picha.',
    sv: '1. Hitta din webbkamera, vanligtvis högst upp i mitten av skärmen (med ett litet vitt eller grönt ljus).\n2. I följande steg kommer du att be webbkameran att ta en bild av ditt ansikte, bara för att mäta ditt avstånd. \n    • Bilden raderas omedelbart efter.\n    • För att mäta avståndet måste ögonblicksbilden inkludera dina ögon och haka.\n    • Fokusera på ditt avstånd vid ögonblicksbilden.\n3. Håll mätobjektet med ena änden vidrör skärmen, nära webbkameran, och den andra vidrör ditt ansikte, nära ögat.\n4. Luta dig inåt tills ditt avstånd mellan öga och webbkamera matchar objektets längd.\n5. Frys i den positionen, avtäck ditt ansikte och tryck sedan på MELLANSLAG för att ta ögonblicksbilden.',
