    he: '1. עצמו את העין השמאלית. (זהו הצד השמאלי של המסך.)\n2. השתמש במקש החץ ▶ כדי להחליק את הנקודה המהבהבת. \n3. תוך כדי הסתכלות על הצלב, עקוב אחר הנקודה המרצדת בזווית העין שלך, והחלק אותה ימינה ושמאלה עד שהיא נעלמת בנקודה העיוורת שלך.\n4. כאשר הוא בלתי נראה, הקש על מקש הרווח או לחץ על אישור.\nהערה: שימו עין על הצלב. הנקודה המרצדת לא תיעלם בזמן שהעין שלך עוקבת אחריה.',
    hi: '1. अपनी बाईं आँख बंद करें। (यह स्क्रीन का बायाँ भाग है।)\n2. टिमटिमाते बिंदु को स्लाइड करने के लिए तीर कुंजी ▶ का प्रयोग करें।\n3. क्रॉस को देखते हुए, अपनी आँख के कोने में टिमटिमाते बिंदु पर नज़र रखें और उसे दाएँ-बाएँ तब तक स्लाइड करें जब तक वह आपके ब्लाइंडस्पॉट में गायब न हो जाए।\n4. जब वह दिखाई न दे, तो स्पेस बार पर टैप करें या ओके पर क्लिक करें।\nनोट: अपनी नज़र क्रॉस पर रखें। जब तक आपकी नज़र उस पर रहेगी, टिमटिमाता बिंदु गायब नहीं होगा।',
