    ja: '1. 右目を閉じます。（画面の右側です。）\n2. 矢印キー◀を使って、点滅する点をスライドさせます。\n3. 十字を見ながら、目の端にある点滅する点を左右にスライドさせ、盲点に消えるまで続けます。\n3. スペースバーを押します。\n注：十字から目を離さないでください。目で十字を追っている間は、点滅する点は消えません。',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: 'Loading...',
    ml: '1. നിങ്ങളുടെ വലത് കണ്ണ് അടയ്ക്കുക. (ഇത് സ്ക്രീനിൻ്റെ വലതുഭാഗമാണ്.)\n2. മിന്നുന്ന ഡോട്ട് സ്ലൈഡ് ചെയ്യാൻ അമ്പടയാള കീ ◀ ഉപയോഗിക്കുക. \n3. കുരിശിലേക്ക് നോക്കുമ്പോൾ, നിങ്ങളുടെ കണ്ണിൻ്റെ കോണിലുള്ള മിന്നുന്ന ഡോട്ട് നിരീക്ഷിക്കുക, അത് നിങ്ങളുടെ ബ്ലൈൻഡ്‌സ്‌പോട്ടിലേക്ക് അപ്രത്യക്ഷമാകുന്നതുവരെ ഇടത്തോട്ടും വലത്തോട്ടും സ്ലൈഡ് ചെയ്യുക.\n3. SPACE ബാറിൽ അമർത്തുക.\nശ്രദ്ധിക്കുക: കുരിശിൽ നിങ്ങളുടെ കണ്ണ് വയ്ക്കുക. നിങ്ങളുടെ കണ്ണ് അതിനെ പിന്തുടരുമ്പോൾ മിന്നുന്ന ഡോട്ട് അപ്രത്യക്ഷമാകില്ല.',
    no: '1. Lukk HØYRE øye. (Dette er høyre side av skjermen.)\n2. Bruk piltasten ◀ for å skyve den flimrende prikken. \n3. Mens du ser på korset, overvåk den flimrende prikken i øyekroken, og skyv den til venstre og høyre til den forsvinner inn i blindsonen.\n3. Trykk på MELLOMROM.\nMERK: Hold øye med korset. Den flimrende prikken forsvinner ikke mens øyet følger den.',
    fa: '1. چشم راست خود را ببندید. (این سمت راست صفحه است.)\n2. از کلید پیکان ◀ برای حرکت نقطه در حال چشمک زدن استفاده کنید.\n3. در حالی که به صلیب نگاه می‌کنید، نقطه چشمک‌زن را در گوشه چشم خود زیر نظر بگیرید و آن را به چپ و راست حرکت دهید تا زمانی که در نقطه کور شما ناپدید شود.\n4. کلید SPACE را فشار دهید.\nتوجه: چشم خود را روی صلیب نگه دارید. نقطه چشمک‌زن در حالی که چشمتان آن را دنبال می‌کند، ناپدید نخواهد شد.',
