    kn: 'Loading...',
    ko: 'Loading...',
    lt: '1. Pakreipkite ir pasukite šį ekraną, kad vaizdo įrašo sklaidos kanalo akys būtų centre.\n2. Naudodami matavimo juostą arba matavimo lazdelę, nustatykite vieną akį [[N11]] [[UUU]] nuo ekrano centro.\n3. Jei naudojate juostą, miniatiūra pažymėkite norimą ilgį ir padėkite ją netoli ekrano centro. Laikykite juostos galą prie akies.\n4. Jei atstumas per didelis, kad jį būtų galima nustatyti arba išmatuoti, paspauskite ❌ arba X, kad jį praleistumėte.\n5. Kai atstumas mažas, įsitikinkite, kad fotoaparatas mato jūsų akis ir smakrą.\n6. Nustatę teisingą padėtį, nejudinkite, atidenkite veidą fotoaparatui ir paspauskite tarpo klavišą.\n7. Žemiau esanti žalia juosta rodo jūsų pažangą. \n8. Pakartokite kitą atstumą.\nPASTABA: jei telefono klaviatūra užšąla, bakstelėkite jos adreso juostą ir paspauskite Go.',
    ms: 'Loading...',
