    no: 'Loading...',
    fa: '1. این صفحه را کج کرده و بچرخانید تا چشمانتان در فید ویدیو متمرکز شود.\n2. با استفاده از یک متر یا چوب اندازه گیری، یک چشم [[N11]] [[UUU]] را از مرکز صفحه نمایش قرار دهید.\n3. در صورت استفاده از نوار، طول مورد نظر را با تصویر کوچک خود علامت بزنید و آن را نزدیک مرکز صفحه نمایش قرار دهید. انتهای نوار را نزدیک چشم خود نگه دارید.\n4. اگر فاصله برای تنظیم یا اندازه گیری خیلی دور است، برای رد کردن آن، ❌ یا X را فشار دهید.\n5. وقتی فاصله کم است، مطمئن شوید که دوربین می تواند چشم ها و چانه شما را ببیند.\n6. پس از قرارگیری صحیح، ثابت نگه دارید، چهره خود را برای دوربین باز کنید و SPACE را فشار دهید.\n7. نوار سبز رنگ زیر پیشرفت شما را نشان می دهد. \n8. برای مسافت بعدی این کار را تکرار کنید.\nتوجه: اگر صفحه کلید تلفن یخ زد، روی نوار آدرس آن ضربه بزنید و Go را فشار دهید.',
