    tl: '1. Ikiling at paikutin ang screen na ito upang isentro ang iyong mga mata sa video feed.\n2. Gamit ang tape measure o measuring stick, iposisyon ang isang mata [[N11]] [[UUU]] mula sa gitna ng screen.\n3. Kung gumagamit ng tape, markahan ang nais na haba gamit ang iyong thumbnail at ilagay ito malapit sa gitna ng screen. Hawakan ang dulo ng tape malapit sa iyong mata.\n4. Kung ang distansya ay masyadong malayo para i-set up o sukatin, pindutin ang ❌ o X upang laktawan ito.\n5. Kapag maikli ang distansya, siguraduhing nakikita ng camera ang iyong mga mata at baba.\n6. Kapag nakapwesto nang tama, pigilin, alisan ng takip ang iyong mukha para sa camera, at pindutin ang SPACE.\n7. Ang berdeng bar sa ibaba ay nagpapakita ng iyong pag-unlad. \n8. Ulitin para sa susunod na distansya.\nTANDAAN: Kung nag-freeze ang keypad ng telepono, tapikin ang address bar nito at pindutin ang Go.',
