    ar: '1. باستخدام شريط قياس أو عصا قياس، ضع عين واحدة [[N11]] [[UUU]] من مركز الشاشة.\n2. إذا كنت تستخدم شريطًا، فضع علامة على الطول المطلوب بإبهامك وضعه بالقرب من مركز الشاشة. امسك طرف الشريط بالقرب من عينك.\n3. إذا كانت المسافة بعيدة جدًا بحيث يتعذر ضبطها أو قياسها، فاضغط على ❌ أو X لتخطيها.\n4. عندما تكون المسافة قصيرة، تأكد من أن الكاميرا يمكنها رؤية عينيك وذقنك.\n5. بمجرد وضعك في الموضع الصحيح، ابق ثابتًا، واكشف وجهك للكاميرا، واضغط على SPACE.\n6. يظهر الشريط الأخضر أدناه تقدمك. \n7. كرر العملية للمسافة التالية.\nملاحظة: إذا تجمدت لوحة مفاتيح الهاتف، فانقر على شريط العنوان واضغط على Go.',
    hy: 'Loading...',
    bg: 'Loading...',
    'zh-CN': 'Loading...',
    'zh-TW':
      '1. 使用捲尺或量尺，將一隻眼睛 [[N11]] [[UUU]] 放置在距離螢幕中心的位置。\n2. 如果使用捲尺，請用拇指指甲標記所需長度，並將其放在靠近螢幕中心的位置。將捲尺末端放在眼睛附近。\n3. 如果距離太遠，無法設定或測量，請按 ❌ 或 X 跳過此步驟。\n4. 如果距離較近，請確保相機捕捉您的眼睛和下巴。\n5. 正確定位後，保持不動，露出臉部，然後按下空白鍵。\n6. 下方的綠色條顯示您的進度。\n7. 重複此操作，測量下一個距離。\n注意：如果手機鍵盤卡住，請點選其網址欄，然後按下「開始」。',
