    lt: 'Loading...',
    ms: 'Loading...',
    ml: '1. ഒരു ടേപ്പ് അളവോ അളക്കുന്ന വടിയോ ഉപയോഗിച്ച്, സ്ക്രീനിൻ്റെ മധ്യത്തിൽ നിന്ന് ഒരു കണ്ണ് [[N11]] [[UUU]] സ്ഥാപിക്കുക.\n2. ഒരു ടേപ്പ് ഉപയോഗിക്കുകയാണെങ്കിൽ, നിങ്ങളുടെ ലഘുചിത്രം ഉപയോഗിച്ച് ആവശ്യമുള്ള നീളം അടയാളപ്പെടുത്തി സ്ക്രീനിൻ്റെ മധ്യഭാഗത്ത് വയ്ക്കുക. ടേപ്പിൻ്റെ അറ്റം നിങ്ങളുടെ കണ്ണിന് സമീപം പിടിക്കുക.\n3. സജ്ജീകരിക്കാനോ അളക്കാനോ ഉള്ള ദൂരം വളരെ ദൂരെയാണെങ്കിൽ, അത് ഒഴിവാക്കാൻ ❌ അല്ലെങ്കിൽ X അമർത്തുക.\n4. ദൂരം കുറവായിരിക്കുമ്പോൾ, ക്യാമറയ്ക്ക് നിങ്ങളുടെ കണ്ണുകളും താടിയും കാണാൻ കഴിയുമെന്ന് ഉറപ്പാക്കുക.\n5. ശരിയായി സ്ഥാനം നൽകിക്കഴിഞ്ഞാൽ, നിശ്ചലമായി പിടിക്കുക, ക്യാമറയ്‌ക്കായി നിങ്ങളുടെ മുഖം മറയ്ക്കുക, SPACE അമർത്തുക.\n6. താഴെയുള്ള പച്ച ബാർ നിങ്ങളുടെ പുരോഗതി കാണിക്കുന്നു. \n7. അടുത്ത ദൂരത്തേക്ക് ആവർത്തിക്കുക.\nശ്രദ്ധിക്കുക: ഫോൺ കീപാഡ് മരവിച്ചാൽ, അതിൻ്റെ വിലാസ ബാറിൽ ടാപ്പുചെയ്‌ത് Go അമർത്തുക.',
    no: '1. Plasser det ene øyet [[N11]] [[UUU]] fra midten av skjermen med et målebånd eller målestav.\n2. Hvis du bruker en tape, merk ønsket lengde med miniatyrbildet og plasser det nær midten av skjermen. Hold båndenden nær øyet.\n3. Hvis avstanden er for lang til å sette opp eller måle, trykk på ❌ eller X for å hoppe over den.\n4. Når avstanden er kort, sørg for at kameraet kan se øynene og haken.\n5. Når den er riktig plassert, hold stille, avdekk ansiktet ditt for kameraet og trykk på MELLOMROM.\n6. Den grønne linjen nedenfor viser fremgangen din. \n7. Gjenta for neste distanse.\nMERK: Hvis telefonens tastatur fryser, trykker du på adresselinjen og trykker på Gå.',
