    fa: '1. عرض و ارتفاع صفحهٔ روشن را برحسب سانتی‌متر اندازه‌گیری کنید.\n 2. هر حاشیه — چپ، راست، بالا و پایین — را از لبهٔ صفحه تا لبهٔ فیزیکی مانیتور اندازه‌گیری کنید.\n 3. ارتفاع از سطح میز تا لبهٔ پایین مانیتور را اندازه‌گیری کنید. این همان لبهٔ پایین حاشیه است.',
    pl: 'Loading...',
