    id: 'Dengan berpartisipasi dalam studi ini, Anda dapat memberikan kontribusi yang berarti bagi kemajuan penelitian pendengaran daring dengan menyediakan data penting tentang beragam mikrofon ponsel pintar dan pengeras suara komputer. Penelitian ini bertujuan untuk membuat pustaka profil perangkat yang terperinci yang akan meningkatkan akurasi tes pendengaran yang dilakukan daring. Skema ini bergantung pada pencocokan mikrofon ponsel pengguna dengan mikrofon yang telah dikalibrasi di laboratorium. Setiap model memiliki mikrofon yang berbeda, sehingga sangat penting untuk menentukan modelnya.\nMenyadari bahwa privasi adalah prioritas, yakinlah bahwa survei ini hanya menyimpan nomor model ponsel dan komputer. Nomor model ini tidak terkait dengan informasi pribadi apa pun dan tidak mengidentifikasi Anda.',
