      '連結網路\n您正在測試的手機是否已連接到網路？\n1. 如果是，請點選下方的「確定」繼續。\n2. 📶 蜂窩服務：如果手機的蜂窩服務已連接到互聯網，請點擊“確定”。\n3. 🛜 無線網路：透過 WLAN 將手機連接到互聯網，然後點選「確定」。\n4. 📅 設定時間和日期：新手機或已重設的舊手機沒有蜂窩服務帳戶且日期錯誤。設定時間和日期後，它將支援熱點/網路共享，如下所述。\n5. 📱🔗📱熱點：如果測試手機不是您的個人手機，並且您的個人手機已連接互聯網，則兩部手機可以共享互聯網訪問。透過 Wi-Fi、藍牙或 USB 連接手機：\n* 📱🛜📱 Wi-Fi 熱點：如果您的個人手機已透過蜂窩服務連接到互聯網，則可以為測試手機提供 Wi-Fi 熱點。連接後，請點選下方的「確定」。\n* 📱>ᛒ📱 藍牙網路共享：如果您的個人手機使用 Wi-Fi 上網，則可以透過藍牙共享網路。在兩部手機上啟用藍牙（iPhone 上）或藍牙網路共享（安卓手機上），透過藍牙配對，然後點擊下方的「確定」。\n* 📱—📱 USB 網路分享：如果兩部手機都是 iPhone 或安卓手機，它們可以透過 USB 線共享互聯網，前提是您有合適的線。如今，大多數手機使用 USB-C 接口，但 iPhone 14 及更早的機型使用 Lightning 接口。使用適當的數據線連接手機，然後點選下方的「確定」。\n6.❌沒有網路：如果這些選項都不可用，請先按一下下面的“確定”，然後按一下“❌所有連線嘗試失敗”。',
