    fi: 'YHTEYS INTERNETTIIN\nOnko testaamasi puhelin jo yhteydessä Internetiin?\n1. KYLLÄ, ja jatka napsauttamalla alla olevaa OK-painiketta.\n2. 📶 SOLUOPALVELU: Jos puhelimen matkapuhelinpalvelu muodostaa yhteyden Internetiin, napsauta OK.\n3. 🛜 WIFI: Yhdistä puhelin Internetiin Wi-Fin kautta ja napsauta OK.\n4. 📅 ASETTA AIKA JA PÄIVÄMÄÄRÄ: Uudella puhelimella tai vanhalla puhelimella, joka on nollattu, ei ole matkapuhelinpalvelutiliä ja väärä päivämäärä. Kun olet asettanut kellonajan ja päivämäärän, se toimii hotspotin/jaetun yhteyden kanssa, kuten seuraavassa selitetään.\n5. 📱🔗📱HOTSPOT: Jos testipuhelimesi ei ole henkilökohtainen puhelimesi ja henkilökohtaisessa puhelimessasi on internetyhteys, nämä kaksi puhelinta voivat jakaa internetyhteyden. Yhdistä puhelimet toisiinsa Wi-Fi-, Bluetooth- tai USB-yhteydellä:\n    * 📱🛜📱 Wi-Fi-hotspot: Jos henkilökohtainen puhelimesi on yhteydessä internetiin matkapuhelinpalvelun kautta, se voi tarjota Wi-Fi-hotspotin testipuhelimelle. Kun yhteys on muodostettu, napsauta OK alla.\n    * 📱>ᛒ📱 Bluetooth-jako: Jos henkilökohtainen puhelimesi käyttää Wi-Fi-yhteyttä Internetiin, se voi jakaa Internet-yhteyden Bluetoothin kautta. Ota Bluetooth (iPhonessa) tai Bluetooth-jako (Androidissa) käyttöön molemmissa puhelimissa, yhdistä ne Bluetoothin kautta ja napsauta alla OK.\n    * 📱—📱 USB-jako: Jos molemmat puhelimet ovat iPhone-puhelimia tai molemmat puhelimet ovat Android-puhelimia, ne voivat jakaa Internet-yhteyden USB-kaapelin kautta, jos sinulla on oikea kaapeli. Nykyään useimmat puhelimet käyttävät USB-C-liitintä, mutta iPhone 14 ja aiemmat käyttävät Lightning-liitintä. Liitä puhelimet sopivalla kaapelilla ja napsauta OK alla.\n6. ❌ EI INTERNETTIÄ: Jos mikään näistä vaihtoehdoista ei ole käytettävissä, napsauta ensin OK alla ja sitten "❌ Kaikki yhteysyritykset epäonnistuivat".',
    fr: 'Loading...',
