    el: 'ΣΥΝΔΕΣΗ ΣΤΟ ΔΙΑΔΙΚΤΥΟ\nΤο τηλέφωνο που δοκιμάζετε είναι ήδη συνδεδεμένο στο διαδίκτυο;\n1. YES, στη συνέχεια κάντε κλικ στο OK παρακάτω για να συνεχίσετε.\n2. 📶 CELL SERVICE: Εάν η υπηρεσία κινητής τηλεφωνίας του τηλεφώνου συνδέεται στο διαδίκτυο, κάντε κλικ στο OK.\n3. 🛜 WIFI: Συνδέστε το τηλέφωνο στο διαδίκτυο μέσω Wi-Fi και κάντε κλικ στο OK.\n4. 📅 ΡΥΘΜΙΣΗ ΩΡΑΣ ΚΑΙ ΗΜΕΡΟΜΗΝΙΑΣ: Ένα νέο τηλέφωνο ή ένα παλιό τηλέφωνο που έχει γίνει επαναφορά, δεν έχει λογαριασμό κινητής τηλεφωνίας και λάθος ημερομηνία. Μόλις ορίσετε την ώρα και την ημερομηνία, θα λειτουργεί με hotspot/tethering, όπως εξηγείται στη συνέχεια.\n5. 📱📱ΣΗΜΕΙΟ: Εάν το τηλέφωνο δοκιμής δεν είναι το προσωπικό σας τηλέφωνο και το προσωπικό σας τηλέφωνο διαθέτει internet, τα δύο τηλέφωνα μπορούν να έχουν κοινή πρόσβαση στο Διαδίκτυο. Συνδέστε τα τηλέφωνα μεταξύ τους μέσω Wi-Fi, Bluetooth ή USB:\n    * 📱🛜📱 Wi-Fi Hotspot: Εάν το προσωπικό σας τηλέφωνο είναι συνδεδεμένο στο διαδίκτυο μέσω υπηρεσίας κινητής τηλεφωνίας, μπορεί να παρέχει ένα σημείο πρόσβασης Wi-Fi στο τηλέφωνο δοκιμής. Μόλις συνδεθείτε, κάντε κλικ στο OK παρακάτω.\n    * 📱>ᛒ📱 Bluetooth Tethering: Εάν το προσωπικό σας τηλέφωνο χρησιμοποιεί Wi-Fi για πρόσβαση στο Διαδίκτυο, μπορεί να μοιραστεί την πρόσβαση στο Διαδίκτυο μέσω Bluetooth. Ενεργοποιήστε το Bluetooth (σε iPhone) ή τη σύνδεση Bluetooth (σε Android) και στα δύο τηλέφωνα, πραγματοποιήστε σύζευξη μέσω Bluetooth και κάντε κλικ στο OK παρακάτω.\n    * 📱 — Σήμερα, τα περισσότερα τηλέφωνα χρησιμοποιούν υποδοχή USB-C, αλλά το iPhone 14 και παλαιότερα χρησιμοποιούν την υποδοχή Lightning. Συνδέστε τα τηλέφωνα μέσω του κατάλληλου καλωδίου και κάντε κλικ στο OK παρακάτω.\n6. ❌ ΟΧΙ ΔΙΑΔΙΚΤΥΟ: Εάν καμία από αυτές τις επιλογές δεν είναι διαθέσιμη, κάντε πρώτα κλικ στο OK παρακάτω και, στη συνέχεια, «❌ Όλες οι προσπάθειες σύνδεσης απέτυχαν».',
    he: 'Loading...',
    hi: 'Loading...',
    hu: 'CSATLAKOZÁS AZ INTERNETHEZ\nA tesztelt telefon már csatlakozik az internethez?\n1. IGEN, majd kattintson az OK gombra lentebb a folytatáshoz.\n2. 📶 CELL SZOLGÁLTATÁS: Ha a telefon mobilszolgáltatása csatlakozik az internethez, kattintson az OK gombra.\n3. 🛜 WIFI: Csatlakoztassa a telefont az internethez Wi-Fi-n keresztül, majd kattintson az OK gombra.\n4. 📅 IDŐ ÉS DÁTUM BEÁLLÍTÁSA: Egy új vagy egy visszaállított régi telefonnak nincs mobilszolgáltatási fiókja, és rossz a dátum. Miután beállította az időt és a dátumot, a hotspottal/internetmegosztással fog működni, amint azt a következőkben ismertetjük.\n5. 📱🔗📱HOTSPOT: Ha a teszttelefon nem az Ön személyes telefonja, és a személyes telefonján van internet, a két telefon megoszthatja az internet-hozzáférést. Csatlakoztassa a telefonokat egymáshoz Wi-Fi-n, Bluetooth-on vagy USB-n keresztül:\n    * 📱🛜📱 Wi-Fi Hotspot: Ha személyes telefonja mobilszolgáltatáson keresztül csatlakozik az internethez, Wi-Fi hotspotot tud biztosítani a teszttelefonnak. A csatlakozás után kattintson az OK gombra lent.\n    * 📱>ᛒ📱 Bluetooth-internetmegosztás: Ha személyes telefonja Wi-Fi-t használ az internet-hozzáféréshez, meg tudja osztani az internet-hozzáférést Bluetooth-on keresztül. Mindkét telefonon engedélyezze a Bluetooth-t (iPhone-on) vagy a Bluetooth-megosztást (Androidon), párosítsa őket Bluetooth-on keresztül, majd kattintson az OK gombra lent.\n    * 📱—📱 USB-internetmegosztás: Ha mindkét telefon iPhone, vagy mindkét telefon Androidos, USB-kábelen keresztül megoszthatják az internet-hozzáférést, feltéve, hogy rendelkezik a megfelelő kábellel. Manapság a legtöbb telefon USB-C csatlakozót használ, de az iPhone 14 és korábbi modellek a Lightning csatlakozót. Csatlakoztassa a telefonokat a megfelelő kábellel, majd kattintson az OK gombra lent.\n6. ❌ NINCS INTERNET: Ha ezen opciók egyike sem elérhető, először kattintson az OK gombra lent, majd a „❌ Minden csatlakozási kísérlet sikertelen” gombra.',
    is: 'TENGST VIÐ NET\nEr síminn sem þú ert að prófa þegar tengdur við internetið?\n1. JÁ, smelltu síðan á Í lagi hér að neðan til að halda áfram.\n2. 📶 FRAMÞJÓNUSTA: Ef farsímaþjónusta símans tengist internetinu, smelltu á OK.\n3. 🛜 WIFI: Tengdu símann við internetið í gegnum Wi-Fi og smelltu á OK.\n4. 📅 STILLA TÍMA OG DAGSETNING: Nýr sími, eða gamall sími sem hefur verið endurstilltur, hefur engan farsímaþjónustureikning og ranga dagsetningu. Þegar þú hefur stillt tíma og dagsetningu mun það virka með heitum reit/tjóðrun, eins og útskýrt er næst.\n5. 📱🔗📱HOTSPOT: Ef prófunarsíminn er ekki persónulegi síminn þinn og einkasíminn þinn er með internet, geta símarnir tveir deilt internetaðgangi. Tengdu símana hver við annan með Wi-Fi, Bluetooth eða USB:\n    * 📱🛜📱 Wi-Fi heitur reitur: Ef persónulegi síminn þinn er tengdur við internetið í gegnum farsímaþjónustu getur hann veitt prófunarsímanum Wi-Fi heitan reit. Þegar þú hefur tengt skaltu smella á OK hér að neðan.\n    * 📱>ᛒ📱 Bluetooth-tjóðrun: Ef einkasíminn þinn notar Wi-Fi fyrir internetaðgang getur hann deilt internetaðganginum í gegnum Bluetooth. Virkjaðu Bluetooth (á iPhone) eða Bluetooth-tjóðrun (á Android) á báðum símum, paraðu þá í gegnum Bluetooth og smelltu á Í lagi hér að neðan.\n    * 📱—📱 USB-tjóðrun: Ef báðir símarnir eru iPhone eða báðir símar Android geta þeir deilt netaðganginum með USB snúru, að því tilskildu að þú sért með réttu snúruna. Í dag nota flestir símar USB-C tengi, en iPhone 14 og eldri nota Lightning tengið. Tengdu símana með viðeigandi snúru og smelltu á Í lagi hér að neðan.\n6. ❌ EKKERT INTERNET: Ef enginn af þessum valkostum er tiltækur, smelltu fyrst á Í lagi hér að neðan og síðan á „❌ Allar tengingartilraunir mistókust“.',
