    fa: 'اتصال به اینترنت\n آیا گوشی‌ای که در حال تست آن هستید قبلاً به اینترنت متصل است؟\n 1. بله – برای ادامه روی OK زیر کلیک کنید.\n 2. 📶 سرویس تلفن: اگر سرویس تلفن به اینترنت متصل می‌شود، روی OK کلیک کنید.\n 3. 🛜 وای‌فای: گوشی را از طریق Wi-Fi به اینترنت متصل کرده و سپس روی OK کلیک کنید.\n 4. 📅 تنظیم تاریخ و زمان: یک گوشی جدید یا گوشی قدیمی که ریست شده‌است، حساب سرویس تلفن و تاریخ صحیح ندارد. پس از تنظیم تاریخ و زمان، با هات‌اسپات/تترینگ کار خواهد کرد که در ادامه توضیح داده شده است.\n 5. 📱🔗📱 هات‌اسپات: اگر گوشی تست، گوشی شخصی شما نیست و گوشی شخصی شما اینترنت دارد، دو گوشی می‌توانند اینترنت را به اشتراک بگذارند. گوشی‌ها را از طریق Wi-Fi، بلوتوث یا USB به هم متصل کنید:\n * 📱🛜📱 هات‌اسپات وای‌فای: اگر گوشی شخصی شما از طریق سرویس تلفن به اینترنت متصل است، می‌تواند هات‌اسپات Wi-Fi برای گوشی تست فراهم کند. پس از اتصال، روی OK زیر کلیک کنید.\n * 📱>ᛒ📱 تترینگ بلوتوث: اگر گوشی شخصی شما از Wi-Fi برای دسترسی به اینترنت استفاده می‌کند، می‌تواند دسترسی اینترنت را از طریق بلوتوث به اشتراک بگذارد. بلوتوث (در آیفون) یا تترینگ بلوتوث (در اندروید) را در هر دو گوشی فعال کنید، آن‌ها را جفت کنید و روی OK زیر کلیک کنید.\n * 📱—📱 تترینگ USB: اگر هر دو گوشی آیفون هستند یا هر دو اندروید، می‌توانند از طریق کابل USB دسترسی اینترنت را به اشتراک بگذارند، به شرطی که کابل مناسب داشته باشید. امروزه بیشتر گوشی‌ها از کانکتور USB-C استفاده می‌کنند، اما آیفون ۱۴ و قبل از آن از کانکتور لایتنینگ استفاده می‌کنند. گوشی‌ها را با کابل مناسب متصل کرده و روی OK زیر کلیک کنید.\n 6. ❌ بدون اینترنت: اگر هیچ‌کدام از این گزینه‌ها در دسترس نیست، ابتدا روی OK زیر کلیک کنید و سپس روی «❌ همه تلاش‌ها برای اتصال ناموفق بود» کلیک کنید.',
    pl: "ŁĄCZENIE Z INTERNETEM\nCzy testowany telefon jest już połączony z internetem?\n1. TAK, a następnie kliknij OK poniżej, aby kontynuować.\n2. 📶 SIEĆ KOMÓRKOWA: Jeśli telefon łączy się z internetem za pośrednictwem sieci komórkowej, kliknij OK.\n3. 🛜 WI-FI: Połącz telefon z internetem przez Wi-Fi i kliknij OK.\n4. 📅 USTAW GODZINĘ I DATY: Nowy telefon lub stary telefon, który został zresetowany, nie ma konta w sieci komórkowej i ma nieprawidłową datę. Po ustawieniu godziny i daty telefon będzie działał z hotspotem/tetheringiem, jak wyjaśniono poniżej.\n5. 📱🔗📱HOTSPOT: Jeśli testowany telefon nie jest Twoim telefonem osobistym, a Twój telefon osobisty ma dostęp do internetu, oba telefony mogą współdzielić dostęp do internetu. Połącz telefony ze sobą przez Wi-Fi, Bluetooth lub USB:\n* 📱🛜📱 Hotspot Wi-Fi: Jeśli Twój telefon jest połączony z internetem przez sieć komórkową, może zapewnić hotspot Wi-Fi dla telefonu testowego. Po nawiązaniu połączenia kliknij OK poniżej.\n* 📱>ᛒ📱 Tethering przez Bluetooth: Jeśli Twój telefon korzysta z Wi-Fi do dostępu do internetu, może udostępniać internet przez Bluetooth. Włącz Bluetooth (na iPhonie) lub tethering przez Bluetooth (na Androidzie) na obu telefonach, sparuj je przez Bluetooth i kliknij OK poniżej.\n* 📱—📱 Tethering przez USB: Jeśli oba telefony to iPhone'y lub oba telefony to Androidy, mogą udostępniać internet przez kabel USB, pod warunkiem posiadania odpowiedniego kabla. Obecnie większość telefonów korzysta ze złącza USB-C, ale iPhone 14 i starsze modele korzystają ze złącza Lightning. Połącz telefony odpowiednim kablem i kliknij OK poniżej.\n6. ❌ BRAK INTERNETU: Jeśli żadna z tych opcji nie jest dostępna, najpierw kliknij przycisk OK poniżej, a następnie „❌ Wszystkie próby połączenia nie powiodły się”.",
