    sv: 'ANSLUTA TILL INTERNET\nÄr telefonen du testar redan ansluten till internet?\n1. JA, klicka sedan på OK nedan för att fortsätta.\n2. 📶 CELLTJÄNST: Om telefonens mobiltjänst ansluter till internet klickar du på OK.\n3. 🛜 WIFI: Anslut telefonen till internet via Wi-Fi och klicka på OK.\n4. 📅 STÄLL IN TID OCH DATUM: En ny telefon, eller en gammal telefon som har återställts, har inget mobiltjänstkonto och fel datum. När du har ställt in tid och datum kommer det att fungera med hotspot/tethering, som förklaras härnäst.\n5. 📱🔗📱HOTSPOT: Om testtelefonen inte är din personliga telefon, och din personliga telefon har internet, kan de två telefonerna dela internetåtkomst. Anslut telefonerna till varandra via Wi-Fi, Bluetooth eller USB:\n    * 📱🛜📱 Wi-Fi-hotspot: Om din personliga telefon är ansluten till internet via mobiltjänst kan den tillhandahålla en Wi-Fi-hotspot till testtelefonen. När du är ansluten klickar du på OK nedan.\n    * 📱>ᛒ📱 Bluetooth-internetdelning: Om din personliga telefon använder Wi-Fi för internetåtkomst kan den dela internetåtkomsten via Bluetooth. Aktivera Bluetooth (på iPhone) eller Bluetooth-internetdelning (på Android) på båda telefonerna, koppla ihop dem via Bluetooth och klicka på OK nedan.\n    * 📱—📱 USB-internetdelning: Om båda telefonerna är iPhones eller båda telefonerna är Androids kan de dela internetåtkomsten via en USB-kabel, förutsatt att du har rätt kabel. Idag använder de flesta telefoner en USB-C-kontakt, men iPhone 14 och tidigare använder Lightning-kontakten. Anslut telefonerna via lämplig kabel och klicka på OK nedan.\n6. ❌ INGET INTERNET: Om inget av dessa alternativ är tillgängligt, klicka först på OK nedan och sedan på “❌ Alla anslutningsförsök misslyckades”.',
