    it: 'Loading...',
    ja: '電話のプライバシーの保証\n本ソフトウェアは、接続された電話を以下の目的にのみ使用します。\n1. 遠距離からでも電話をワイヤレスキーパッドとして使用する。\n2. お使いの電話のマイクで、既存のモデル固有のサウンドプロファイルを使用してコンピューターのスピーカーをキャリブレーションする。EasyEyesプロファイルライブラリから適切なサウンドプロファイルを選択するために、お使いの電話のメーカーとモデル名の入力を求められます。\n[3. 電話のマイクをキャリブレーションする科学者の場合、許可を与えると、測定されたプロファイルがEasyEyesプロファイルライブラリに追加され、プロファイルの作成者であることを示すために、メールアドレスが提供されます。]\n\nマイクのプライバシーの保証\n録音中、ソフトウェアは大きな音を再生し、「静かにしてください。録音中です」と目立つように表示します。録音は、マイクとスピーカーの特性を測定するためにのみ使用されます。マイクとスピーカーの特性のみが保持されます。',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: 'Loading...',
    ml: 'ഫോൺ സ്വകാര്യതയുടെ ഗ്യാരണ്ടി\nഈ സോഫ്‌റ്റ്‌വെയർ കണക്റ്റുചെയ്‌ത ഫോൺ ഇനിപ്പറയുന്നതിലേക്ക് മാത്രം ഉപയോഗിക്കുന്നു:\n1. ദീർഘദൂരത്തിൽ ഫോൺ വയർലെസ് കീപാഡായി ഉപയോഗിക്കുക,\n2. നിങ്ങളുടെ കമ്പ്യൂട്ടറിൻ്റെ സ്പീക്കർ കാലിബ്രേറ്റ് ചെയ്യുന്നതിന് നിങ്ങളുടെ ഫോണിൻ്റെ മൈക്രോഫോണിനൊപ്പം നിലവിലുള്ള മോഡൽ-നിർദ്ദിഷ്ട ശബ്‌ദ പ്രൊഫൈൽ ഉപയോഗിക്കുക. EasyEyes പ്രൊഫൈൽ ലൈബ്രറിയിൽ നിന്ന് ഉചിതമായ ശബ്‌ദ പ്രൊഫൈൽ തിരഞ്ഞെടുക്കുന്നതിന് നിങ്ങളുടെ ഫോണിൻ്റെ നിർമ്മാണവും മോഡലും നിങ്ങളോട് ആവശ്യപ്പെടും.\n[3. നിങ്ങൾ ഫോൺ മൈക്രോഫോണുകൾ കാലിബ്രേറ്റ് ചെയ്യുന്ന ഒരു ശാസ്ത്രജ്ഞനാണെങ്കിൽ, നിങ്ങൾ അനുമതി നൽകിയാൽ, അളന്ന പ്രൊഫൈൽ EasyEyes പ്രൊഫൈൽ ലൈബ്രറിയിലേക്ക് ചേർക്കും, കൂടാതെ പ്രൊഫൈലിൻ്റെ നിങ്ങളുടെ കർത്തൃത്വം നിങ്ങളുടെ ഇമെയിൽ വിലാസം ഉൾപ്പെടുത്തി സൂചിപ്പിക്കും.]\n\nമൈക്രോഫോൺ സ്വകാര്യതയുടെ ഗ്യാരണ്ടി\nറെക്കോർഡിംഗ് സമയത്ത്, സോഫ്‌റ്റ്‌വെയർ ഉച്ചത്തിലുള്ള ശബ്‌ദം പ്ലേ ചെയ്യുകയും "സൈലൻസ് പ്ലീസ്. ഇപ്പോൾ റെക്കോർഡിംഗ്" എന്ന് പ്രദർശിപ്പിക്കുകയും ചെയ്യുന്നു. മൈക്രോഫോണിൻ്റെയും ഉച്ചഭാഷിണിയുടെയും സവിശേഷതകൾ അളക്കാൻ മാത്രമാണ് റെക്കോർഡിംഗ് ഉപയോഗിക്കുന്നത്. മൈക്രോഫോണിൻ്റെയും ഉച്ചഭാഷിണിയുടെയും സവിശേഷതകൾ മാത്രം നിലനിർത്തിയിരിക്കുന്നു.',
    no: 'GARANTI FOR PERSONVERN FOR TELEFON\nDenne programvaren bruker en tilkoblet telefon kun for å:\n1. bruke telefonen som et trådløst tastatur på lange visningsavstander,\n2. bruk en eksisterende modellspesifikk lydprofil med telefonens mikrofon for å kalibrere datamaskinens høyttaler. Du vil bli bedt om merke og modell på telefonen om å velge riktig lydprofil fra EasyEyes profilbibliotek.\n[3. Hvis du er en forsker som kalibrerer telefonmikrofoner, så, hvis du gir tillatelse, legges den målte profilen til EasyEyes-profilbiblioteket, og ditt forfatterskap av profilen indikeres ved å inkludere e-postadressen din.]\n\nGARANTI FOR MIKROFONPERSONVERN\nMens du tar opp, spiller programvaren høye lyder og viser tydelig "Silence please. Now Recording." Opptaket brukes utelukkende til å måle mikrofon- og høyttaleregenskaper. Bare mikrofon- og høyttalerkarakteristikkene beholdes.',
    fa: 'تضمین حفظ حریم خصوصی تلفن\n این نرم‌افزار از تلفن متصل فقط برای کارهای زیر استفاده می‌کند:\n 1. استفاده از تلفن به‌عنوان صفحه‌کلید بی‌سیم در فواصل دیداری طولانی،\n 2. استفاده از یک پروفایل صوتی مخصوص مدل موجود با میکروفون تلفن شما برای کالیبره کردن بلندگوهای رایانه شما. از شما خواسته خواهد شد تا مدل و سازندهٔ تلفن خود را انتخاب کنید تا پروفایل صوتی مناسب از کتابخانهٔ پروفایل ایزی‌آیز انتخاب شود.\n [3. اگر شما یک دانشمند هستید که میکروفون تلفن‌ها را کالیبره می‌کنید، در صورت اجازه شما، پروفایل اندازه‌گیری شده به کتابخانهٔ پروفایل ایزی‌آیز اضافه می‌شود و نام شما به‌عنوان نویسندهٔ پروفایل از طریق درج آدرس ایمیل شما ذکر می‌شود.]\n \n تضمین حفظ حریم خصوصی میکروفون\n هنگام ضبط، نرم‌افزار صداهای بلند پخش می‌کند و به‌طور برجسته پیام «لطفاً سکوت کنید. اکنون در حال ضبط.» را نمایش می‌دهد. این ضبط صرفاً برای اندازه‌گیری ویژگی‌های میکروفون و بلندگو استفاده می‌شود. تنها ویژگی‌های میکروفون و بلندگو نگه داشته می‌شوند.',
    pl: 'Loading...',
    pt: 'GARANTIA DE PRIVACIDADE DO TELEFONE\nEste software utiliza um telefone conectado apenas para:\n1. usar o telefone como um teclado sem fio a longas distâncias de visualização,\n2. usar um perfil de som específico do modelo existente com o microfone do seu telefone para calibrar o alto-falante do seu computador. Você será solicitado a informar a marca e o modelo do seu telefone para selecionar o perfil de som apropriado na biblioteca de perfis do EasyEyes.\n[3. Se você for um cientista calibrando microfones de telefone, se você conceder permissão, o perfil medido será adicionado à biblioteca de perfis do EasyEyes, e sua autoria do perfil será indicada pela inclusão do seu endereço de e-mail.]\n\nGARANTIA DE PRIVACIDADE DO MICROFONE\nDurante a gravação, o software reproduz sons altos e exibe em destaque: "Silêncio, por favor. Gravando agora". A gravação é usada exclusivamente para medir as propriedades do microfone e do alto-falante. Apenas as características do microfone e do alto-falante são mantidas.',
