    en: "3. MIC. IS IN BOTTOM EDGE. When your phone is vertical, its microphone is in the lower edge.\n4. REMOVE CASE. Expose your phone's microphone by removing any protective case.\n5. REST PHONE ON A TALL DRINKING GLASS (or coffee mug or soda/beer can or or jar or box or stack of books), between you and your keyboard, with the microphone (bottom) edge facing your computer. \n     Laptop speakers are in the keyboard; place your phone so that its microphone is on your line of sight to the keyboard. \n     Desktop speakers are behind a grille; point your phone at the grille.\n6. A PROCEED button will appear below. Click it to start calibrating.",
    ar: '3. الميكروفون موجود في الحافة السفلية. عندما يكون هاتفك في وضع عمودي، يكون الميكروفون في الحافة السفلية.\n4. قم بإزالة الغطاء. اكشف ميكروفون هاتفك عن طريق إزالة أي غطاء واقي.\n5. ضع الهاتف على كوب شرب طويل (أو فنجان قهوة أو علبة صودا/بيرة أو جرة أو صندوق أو كومة من الكتب)، بينك وبين لوحة المفاتيح، بحيث تكون حافة الميكروفون (الجزء السفلي) مواجهة للكمبيوتر. \n     توجد مكبرات صوت الكمبيوتر المحمول في لوحة المفاتيح؛ ضع هاتفك بحيث يكون الميكروفون في خط رؤيتك إلى لوحة المفاتيح. \n     توجد مكبرات صوت الكمبيوتر المكتبي خلف شبكة؛ وجه هاتفك نحو الشبكة.\n6. سيظهر زر "متابعة" أدناه. انقر عليه لبدء المعايرة.',
