    fa: '3. میکروفون در لبهٔ پایین است. زمانی که گوشی شما عمودی است، میکروفون آن در لبهٔ پایین قرار دارد.\n 4. قاب را بردارید. با برداشتن هرگونه قاب محافظ، میکروفون گوشی خود را نمایان کنید.\n 5. گوشی را روی یک لیوان بلند (یا ماگ، قوطی نوشابه/آبجو، شیشه، جعبه یا دسته‌ای از کتاب‌ها) بین خود و صفحه‌کلید قرار دهید، به‌گونه‌ای که لبهٔ میکروفون (پایین) رو به کامپیوتر باشد.\n بلندگوهای لپ‌تاپ در صفحه‌کلید هستند؛ گوشی را طوری قرار دهید که میکروفون آن در راستای دید شما به صفحه‌کلید باشد.\nگوشی خود را به سمت توری بلندگوهای کامپیوتر بگیرید.\n 6. دکمه PROCEED در پایین ظاهر خواهد شد. برای شروع کالیبراسیون روی آن کلیک کنید.',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: '3. MIC. ESTE PE MARCHIA DE JOS. Când telefonul este vertical, microfonul său se află în marginea inferioară.\n4. DEMONTARE CARCASA. Expuneți microfonul telefonului dvs. îndepărtând orice husă de protecție.\n5. ODIHAZĂ TELEFONUL PE UN PAHAR ÎNALT (sau cană de cafea sau cutie de sifon/ber sau sau borcan sau cutie sau teanc de cărți), între tine și tastatură, cu marginea microfonului (inferioară) îndreptată spre computer. \n     Difuzoarele laptopului sunt în tastatură; așezați-vă telefonul astfel încât microfonul să fie pe raza dvs. de vedere față de tastatură. \n     Difuzoarele de pe desktop sunt în spatele unui grilaj; îndreptați telefonul spre grilaj.\n6. Un buton PROCEED va apărea mai jos. Faceți clic pe el pentru a începe calibrarea.',
    ru: 'Loading...',
    sr: '3. МИЦ. ЈЕ У ДОњој ИВИЦИ. Када је ваш телефон вертикално, његов микрофон је у доњој ивици.\n4. УКЛОНИТЕ КУЋИШТЕ. Откријте микрофон телефона тако што ћете уклонити заштитну футролу.\n5. ОСЛОНИТЕ ТЕЛЕФОН НА ВИСОКОЈ ЧАШИ (или шољици за кафу, лименци соде/пива или тегли или кутији или гомилу књига), између вас и ваше тастатуре, са (доњом) ивицом микрофона окренутом ка рачунару. \n     Лаптоп звучници су у тастатури; поставите телефон тако да му микрофон буде у видном пољу тастатуре. \n     Столни звучници су иза решетке; усмерите телефон на решетку.\n6. Испод ће се појавити дугме НАСТАВИ. Кликните на њега да бисте започели калибрацију.',
