    ja: 'Loading...',
    kn: 'Loading...',
    ko: '3. 마이크 설치\n  a. 삼각대 다리 세 개를 최대한 벌립니다.\n  b. 삼각대의 마이크 클립이 회전합니다. 클립의 가장 높은 쪽 가장자리가 더 높은 쪽까지 클립을 완전히 돌립니다.\n  c. 마이크의 아래쪽 끝이 클립의 가장 낮은 가장자리와 맞닿을 때까지 아래에서 위로 마이크를 삼각대 클립에 삽입합니다.\n  d. 기울기를 조정하여 마이크가 수직이 되고 천장을 향하도록 합니다.\n  e. 삼각대를 사용자와 컴퓨터 사이의 테이블에 놓습니다. 삼각대를 돌려 마이크가 사용자 쪽으로 오도록 합니다.\n  f. 삼각대의 가장 먼 쪽 두 다리가 컴퓨터(또는 스피커가 있는 곳) 쪽으로, 그리고 세 번째 다리가 사용자 가까이에 올 때까지 밉니다.\n4. 아래에 진행 버튼이 나타납니다. 클릭하여 보정을 시작합니다.',
    lt: '3. NUSTATYK MIKROFONĄ. \n a. Išskleiskite tris trikojo kojeles kiek įmanoma. \n b. Trikojo mikrofono segtukas yra pasukamas. Pasukite segtuką iki galo iki tos pusės, kuri pakelia aukščiausią spaustuko kraštą. \n c. Įkiškite mikrofoną į trikojo spaustuką iš apačios, kol mikrofono apatinis galas sutampa su žemiausiu spaustuko kraštu. \n d. Sureguliuokite pakreipimą, kad mikrofonas būtų vertikalus, nukreiptas į lubas. \n e. Padėkite trikojį ant stalo tarp savęs ir kompiuterio. Pasukite trikojį, kad mikrofonas atsineštų į savo pusę. \n f. Stumkite trikojį link kompiuterio (ar bet kokio kito, kuriame yra garsiakalbiai), kol tolimos dvi trikojo kojos beveik palies jį, o trečioji kojelė bus šalia jūsų.\n4. Toliau pasirodys mygtukas Tęsti. Spustelėkite jį, kad pradėtumėte kalibruoti.',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: '3. تنظیم میکروفون.\n الف. سه پایه را تا حد ممکن باز کنید.\n ب. گیرهٔ میکروفون سه‌پایه بر روی محور چرخان است. گیره را کامل بچرخانید به سمتی که لبهٔ بالاتر گیره بالاتر باشد.\n ج. میکروفون را از پایین داخل گیره سه‌پایه قرار دهید تا انتهای پایین میکروفون با پایین‌ترین لبهٔ گیره همسطح شود.\n د. زاویه را تنظیم کنید تا میکروفون عمود باشد و به سقف اشاره کند.\n هـ. سه‌پایه را روی میز بین خود و رایانه قرار دهید. سه‌پایه را بچرخانید تا میکروفون به سمت شما باشد.\n و. سه‌پایه را به سمت رایانه (یا هر چیزی که بلندگو دارد) هل دهید تا دو پایهٔ دورتر نزدیک به آن شوند و پایهٔ سوم نزدیک شما باشد.\n 4. دکمه PROCEED در پایین ظاهر خواهد شد. برای شروع کالیبراسیون روی آن کلیک کنید.',
