    fa: 'showMeasuredSoundLevelBool در یک یا چند شرایط TRUE است، بنابراین برای انجام این اندازه‌گیری‌ها به میکروفون نیاز است.\n 1. میکروفون miniDSP UMIK-1 یا 2 خود را به این رایانه وصل کنید.\n 2. آن میکروفون را در پنجرهٔ ورودی صدا در زیر انتخاب کنید.\n 3. نام مدل میکروفون، UMIK-1 یا 2 را انتخاب کنید.\n 4. شماره سریال را وارد کرده و روی دکمه FETCH PROFILE کلیک کنید.\n 5. تنظیم میکروفون\n الف. پایهٔ سه‌پایه را تا حد ممکن باز کنید.\n ب. گیرهٔ میکروفون سه‌پایه روی یک محور چرخان قرار دارد. گیره را کامل بچرخانید به سمتی که لبهٔ بالاتر گیره بالاتر باشد.\n ج. میکروفون را از پایین داخل گیره سه‌پایه قرار دهید تا انتهای پایین میکروفون با پایین‌ترین لبهٔ گیره همسطح شود.\n د. زاویه را تنظیم کنید تا میکروفون عمودی و رو به سقف باشد.\n هـ. سه‌پایه را روی میز بین خود و رایانه قرار دهید. سه‌پایه را بچرخانید تا میکروفون به سمت شما باشد.\n و. سه‌پایه را به سمت رایانه (یا هر چیزی که بلندگو دارد) هل دهید تا دو پایهٔ دورتر تقریباً به آن برسند و پایهٔ سوم نزدیک شما باشد.\n 6. اجازهٔ استفاده از میکروفون. اگر پنجره‌ای برای اجازه دسترسی به میکروفون ظاهر شد، روی «Allow» کلیک کنید.\n 7. ⇧🔊 حداکثر صدا. برای اندازه‌گیری دقیق صدا، صدای رایانه خود را اکنون تا حداکثر افزایش دهید و سپس تا پایان جلسه به آن دست نزنید.\n 8. روی PROCEED کلیک کنید یا RETURN را فشار دهید.',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'showMeasuredSoundLevelBool este TRUE în una sau mai multe condiții, așa că este necesar un microfon pentru a face acele măsurători.\n1. CONECTAȚI microfonul miniDSP UMIK-1 sau 2 la acest computer.\n2. SELECTAȚI acel microfon în fereastra pop-up de intrare de sunet de mai jos.\n3. SELECTAȚI numele modelului de microfon, UMIK-1 sau 2.\n4. Introduceți numărul de SERIE și faceți clic pe butonul FETCH PROFILE.\n5. CONFIGURAȚI MICROFONUL\n o. Întinde cele trei picioare de trepied cât de mult vor. \n b. Clipul pentru microfon al trepiedului este pe un pivot. Rotiți clema până la capăt în orice parte face ca marginea cea mai înaltă a clemei să fie mai sus. \n c. Introduceți microfonul în clema trepiedului, de jos, până când capătul inferior al microfonului este la același nivel cu marginea cea mai de jos a clemei. \n d. Reglați înclinarea pentru a face microfonul vertical, îndreptat spre tavan. \n e. Așezați trepiedul pe masă între dvs. și computer. Rotiți trepiedul pentru a aduce microfonul de partea dvs. \n f. Împingeți trepiedul spre computer (sau orice are difuzoare) până când cele două picioare îndepărtate ale trepiedului aproape îl ating, iar al treilea picior este aproape de tine.\n6. PERMITAȚI UTILIZAREA MICROFONULUI. Dacă o fereastră pop-up solicită permisiunea de a folosi microfonul, faceți clic pe „Permite”.\n7. ⇧🔊 VOLUM MAX. Pentru o măsurare precisă a sunetului, maximizați acum volumul sunetului computerului și apoi nu atingeți volumul până la sfârșitul sesiunii.\n8. Faceţi clic pe PROCEED sau apăsaţi RETURN.',
    ru: 'Loading...',
    sr: 'сховМеасуредСоундЛевелБоол је ТРУЕ у једном или више услова, тако да је потребан микрофон за та мерења.\n1. ПОВЕЖИТЕ свој миниДСП УМИК-1 или 2 микрофон на овај рачунар.\n2. ОДАБЕРИТЕ тај микрофон у искачућем прозору за улаз звука испод.\n3. ОДАБЕРИТЕ назив модела микрофона, УМИК-1 или 2.\n4. Унесите СЕРИЈСКИ број и кликните на дугме ДОБИЧИ ПРОФИЛ.\n5. ПОДЕШИТЕ ​​МИКРОФОН\n а. Раширите три ноге статива колико год могу. \n б. Спојница за микрофон на стативу је на окретају. Окрените штипаљку до краја на било коју страну која чини највишу ивицу копче вишом. \n ц. Уметните микрофон у држач за статив, одоздо, све док доњи крај микрофона не буде у равни са најнижом ивицом копче. \n д. Подесите нагиб тако да микрофон буде вертикално, окренут према плафону. \n е. Поставите статив на сто између вас и рачунара. Окрените статив да бисте микрофон ставили на своју страну. \n ф. Гурните статив ка рачунару (или било чему да има звучнике) све док га две крајње ноге статива скоро не додирну, а трећа нога не буде близу вас.\n6. ДОЗВОЛИ УПОТРЕБУ МИКРОФОНА. Ако искачући прозор тражи дозволу за коришћење микрофона, кликните на „Дозволи“.\n7. ⇧🔊 МАКСИМАЛНИ ВОЛУМЕ. За прецизно мерење звука, повећајте јачину звука вашег рачунара сада, а затим не додирујте јачину звука док се сесија не заврши.\n8. Кликните на ПРОЦЕЕД или притисните РЕТУРН.',
    es: 'Loading...',
    sw: 'showMeasuredSoundLevelBool ni TRUE katika hali moja au zaidi, kwa hivyo maikrofoni inahitajika ili kufanya vipimo hivyo.\n1. UNGANISHA maikrofoni yako ya miniDSP UMIK-1 au 2 kwenye kompyuta hii.\n2. CHAGUA maikrofoni hiyo kwenye kiibukizi cha ingizo la sauti hapa chini.\n3. CHAGUA jina la muundo wa maikrofoni, UMIK-1 au 2.\n4. Ingiza nambari ya SERIAL, na ubofye kitufe cha GETCH PROFILE.\n5. WEKA MICROPHONE\n a. Kueneza miguu mitatu ya tripod mbali kama wao kwenda. \n b. Klipu ya maikrofoni ya tripod iko kwenye mzunguko. Sogeza klipu hadi upande wowote hufanya makali ya juu zaidi ya klipu kuwa juu. \n c. Ingiza maikrofoni kwenye klipu ya tripod, kutoka chini, hadi mwisho wa maikrofoni uwe laini na ukingo wa chini kabisa wa klipu. \n d. Rekebisha kuinamisha ili kufanya maikrofoni iwe wima, ikielekeza juu ya dari. \n e. Weka tripod kwenye meza kati yako na kompyuta yako. Zungusha tripod ili kuleta maikrofoni upande wako. \n f. Sukuma tripod kuelekea kompyuta yako (au chochote kilicho na spika) hadi miguu miwili ya mbali ya tripod ikaribie kuigusa, na mguu wa tatu uwe karibu nawe.\n6. RUHUSU MATUMIZI YA MICROPHONE. Iwapo dirisha ibukizi litaomba ruhusa ya kutumia maikrofoni, bofya "Ruhusu".\n7. ⇧🔊 MAX VOLUME. Kwa kipimo sahihi cha sauti, tafadhali ongeza sauti ya kompyuta yako sasa, kisha usiguse sauti hadi kipindi kiishe.\n8. Bonyeza PROCEED au bonyeza RETURN.',
