    kn: '1. ಅಡಚಣೆಯನ್ನು ತಪ್ಪಿಸಿ. ಸಾಧ್ಯವಾದರೆ, ಎಚ್ಚರಿಕೆಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ. ಮಾಪನಾಂಕ ನಿರ್ಣಯವು ಅಡ್ಡಿಪಡಿಸಿದರೆ, ಉದಾ. ಒಳಬರುವ ಫೋನ್ ಕರೆ ಮೂಲಕ, ಮತ್ತೆ ಪ್ರಾರಂಭಿಸಲು "ರೆಕಾರ್ಡಿಂಗ್ ಮರುಪ್ರಾರಂಭಿಸಿ" ಬಟನ್ ಒತ್ತಿರಿ.\n2. ಅನುಮತಿ ನೀಡಿ. ಮೈಕ್ರೊಫೋನ್ ಬಳಸಲು ಪಾಪ್ ಅಪ್ ಅನುಮತಿ ಕೇಳಿದರೆ, "ಅನುಮತಿಸು" ಕ್ಲಿಕ್ ಮಾಡಿ.\n3. ನಿಮ್ಮ ಮತ್ತು ನಿಮ್ಮ ಕೀಬೋರ್ಡ್ ನಡುವೆ, ಮೈಕ್ರೊಫೋನ್ (ಕೆಳಭಾಗದ) ಅಂಚನ್ನು ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ಗೆ ಎದುರಾಗಿಟ್ಟುಕೊಂಡು, ಎತ್ತರದ ಡ್ರಿಂಕಿಂಗ್ ಗ್ಲಾಸ್‌ನಲ್ಲಿ (ಅಥವಾ ಕಾಫಿ ಮಗ್ ಅಥವಾ ಸೋಡಾ/ಬಿಯರ್ ಕ್ಯಾನ್) ವಿಶ್ರಮಿಸಿ. ಲ್ಯಾಪ್ಟಾಪ್ ಸ್ಪೀಕರ್ಗಳು ಕೀಬೋರ್ಡ್ನಲ್ಲಿವೆ; ನಿಮ್ಮ ಫೋನ್ ಅನ್ನು ಇರಿಸಿ ಇದರಿಂದ ಅದರ ಮೈಕ್ರೊಫೋನ್ ಕೀಬೋರ್ಡ್‌ಗೆ ನಿಮ್ಮ ದೃಷ್ಟಿಯ ಸಾಲಿನಲ್ಲಿರುತ್ತದೆ. ಡೆಸ್ಕ್‌ಟಾಪ್ ಸ್ಪೀಕರ್‌ಗಳು ಗ್ರಿಲ್‌ನ ಹಿಂದೆ ಇವೆ; ನಿಮ್ಮ ಫೋನ್ ಅನ್ನು ಗ್ರಿಲ್‌ನಲ್ಲಿ ತೋರಿಸಿ.\n4. ಮುಂದುವರೆಯಿರಿ. "ಮುಂದುವರಿಯಿರಿ" ಒತ್ತಿರಿ.',
    ko: '1. 방해를 피하세요. 가능하면 알림을 비활성화하세요. 수신 전화 등으로 인해 보정이 중단된 경우 "녹음 다시 시작" 버튼을 눌러 다시 시작하세요.\n2. 권한 부여. 마이크 사용 권한을 요청하는 팝업 창이 나타나면 "허용"을 클릭하세요.\n3. 키가 큰 유리잔(또는 커피잔, 탄산음료/맥주 캔) 위에 휴대폰을 올려놓고 키보드와 사용자 사이에 놓으세요. 마이크(아래쪽) 가장자리가 컴퓨터를 향하도록 하세요. 노트북 스피커는 키보드에 있습니다. 휴대폰의 마이크가 키보드와 사용자의 시선이 닿는 곳에 놓으세요. 데스크톱 스피커는 그릴 뒤에 있습니다. 휴대폰을 그릴 쪽으로 향하게 하세요.\n4. 진행. "진행"을 누르세요.',
    lt: 'Loading...',
    ms: '1. ELAK GANGGUAN. Jika boleh, lumpuhkan makluman. Jika penentukuran terganggu, cth. dengan panggilan telefon masuk, tekan butang "Mulakan Semula Rakaman" untuk memulakan semula.\n2. BERI KEBENARAN. Jika pop timbul meminta kebenaran untuk menggunakan mikrofon, klik "Benarkan".\n3. REHATKAN TELEFON DI ATAS GELAS MINUM TINGGI (atau cawan kopi atau tin soda/bir), di antara anda dan papan kekunci anda, dengan tepi mikrofon (bawah) menghadap komputer anda. Pembesar suara komputer riba berada di papan kekunci; letakkan telefon anda supaya mikrofonnya berada pada baris penglihatan anda ke papan kekunci. Pembesar suara desktop berada di belakang gril; halakan telefon anda ke gril.\n4. TERUSKAN. Tekan "Teruskan".',
    ml: 'Loading...',
    no: 'Loading...',
    fa: '1. جلوگیری از وقفه. اگر ممکن است اعلان‌ها را غیرفعال کنید. اگر کالیبراسیون قطع شد، مثلاً با تماس تلفنی، دکمه «Restart Recording» را فشار دهید تا دوباره شروع کنید.\n 2. اجازه دادن. اگر پنجره‌ای اجازهٔ استفاده از میکروفون خواست، روی «Allow» کلیک کنید.\n 3. گوشی را روی یک لیوان بلند (یا ماگ یا قوطی نوشابه/آبجو) بین خود و صفحه‌کلید قرار دهید، به‌طوری که لبهٔ میکروفون (پایین) رو به رایانه باشد. بلندگوهای لپ‌تاپ در صفحه‌کلید هستند؛ گوشی را طوری قرار دهید که میکروفون آن در راستای دید شما به صفحه‌کلید باشد. گوشی خود را رو به توری بلندگوهای کامپیوتر بگیرید.\n 4. ادامه دهید. روی «Proceed» کلیک کنید.',
