    lt: '⇧🔊 DIDŽIAUSIA TŪRIS. Norėdami tiksliai kalibruoti garsą, dabar, prieš kalibravimą, padidinkite kompiuterio garso garsumą ir nelieskite garsumo, kol nesibaigs seansas.\nJOKIŲ AUSINIŲ. Išimkite ir atjunkite visas ausines / ausines.\nNAUDOKITE KAMERĄ, KAD GAUTI QR NUORODĄ. Kai toliau pasirodys QR kodas, nukreipkite į jį savo išmaniojo telefono kamerą ir spustelėkite nuorodą, kuri pasirodo išmaniojo telefono ekrane. Tada vykdykite instrukcijas išmaniojo telefono ekrane.\n———————————————————————————————————————————\nTYLAI PRAŠAU! DABAR ĮRAŠYMAS. NELIESKITE GARSUMO VALDIKLIO.\n———————————————————————————————————————————\nPROBLEMA?                                                                                                                                 \n1. Pagrindinis tinklalapis, kuriame jūsų nešiojamajame kompiuteryje veikia „EasyEyes“, naudoja webRTC protokolą, kad galėtų kalbėtis su QR nuoroda susietu tinklalapiu jūsų išmaniajame telefone. Šis protokolas ieško geriausių būdų prisijungti. Geriausia, kai jūsų telefonas ir kompiuteris yra tame pačiame „WiFi“ tinkle.\n                                                                                                                                 \n2. Jei jūsų išmanusis telefonas praneša apie ryšio klaidą, pabandykite išjungti ir iš naujo paleisti išmaniojo telefono naršyklę arba net iš naujo paleisti išmanųjį telefoną.\n                                                                                                                             \n3. Tai reta, bet jei garsas neskamba arba jam pasirodžius nerodomas mygtukas Tęsti, tai reiškia, kad kalibravimas nepavyko. Galite bandyti dar kartą atnaujindami šį naršyklės puslapį: bakstelėkite adresą; bakstelėkite eiti. Paprastai tai padaro.',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: '⇧🔊 حداکثر صدا. برای کالیبره کردن دقیق صدا، صدای رایانه خود را اکنون، پیش از کالیبراسیون، تا حداکثر افزایش دهید و سپس تا پایان جلسه به آن دست نزنید.\n بدون هدفون. هدفون/ایربادها را برداشته و جدا کنید.\n از دوربین برای گرفتن لینک QR استفاده کنید. هنگامی که کد QR در زیر ظاهر شد، دوربین گوشی هوشمند خود را به آن بگیرید و روی لینکی که در صفحه گوشی‌تان ظاهر می‌شود کلیک کنید. سپس دستورالعمل‌های روی صفحه گوشی را دنبال کنید.\n ——————————————————————————————————————————\n لطفاً سکوت کنید! اکنون در حال ضبط. به کنترل صدا دست نزنید.\n ——————————————————————————————————————————\n مشکل؟\n 1. صفحه اصلی وب که EasyEyes را روی لپ‌تاپ شما اجرا می‌کند از پروتکل webRTC برای ارتباط با صفحه وب QR روی گوشی هوشمندتان استفاده می‌کند. این پروتکل بهترین راه اتصال را جستجو می‌کند. بهترین حالت وقتی است که گوشی و رایانه شما هر دو روی یک شبکه WiFi باشند.\n \n 2. اگر گوشی هوشمند شما خطای اتصال گزارش کرد، مرورگر گوشی را ببندید و دوباره باز کنید، یا حتی گوشی را ریستارت کنید.\n \n 3. نادر است، اما اگر صدا پخش نشود یا پس از پخش هیچ دکمه Proceed ظاهر نشود، یعنی کالیبراسیون ناموفق بوده است. می‌توانید دوباره با تازه‌سازی این صفحه مرورگر تلاش کنید: آدرس را لمس کرده و go را بزنید. معمولاً این کار مشکل را حل می‌کند.',
