    tl: '⇧🔊 MAX VOLUME. Para sa tumpak na pagkakalibrate ng tunog, mangyaring i-maximize ang volume ng tunog ng iyong computer ngayon, bago ang pagkakalibrate, at pagkatapos ay huwag pindutin ang volume hanggang sa matapos ang session.\nWALANG HEADPHONES. Alisin at idiskonekta ang anumang mga headphone/earbud.\nGAMITIN ANG CAMERA PARA MAKAKUHA NG QR LINK. Kapag lumitaw ang QR code sa ibaba, ituro ang camera ng iyong smartphone dito, at i-click ang link na lalabas sa screen ng iyong smartphone. Pagkatapos ay sundin ang mga tagubilin sa screen ng smartphone.\n——————————————————————————————————————————\nTAHIMIK PLEASE! NGAYON NAGRE-RECORD. HUWAG hawakan ang VOLUME CONTROL.\n——————————————————————————————————————————\nPROBLEMA?                                                                                                                                 \n1. Ang pangunahing web page na tumatakbo sa EasyEyes sa iyong laptop ay gumagamit ng webRTC protocol upang makipag-usap sa QR-linked na webpage sa iyong smartphone. Ang protocol na ito ay naghahanap ng pinakamahusay sa ilang mga paraan upang kumonekta. Ang pinakamaganda ay kapag ang iyong telepono at computer ay parehong nasa iisang WiFi network.\n                                                                                                                                 \n2. Kung ang iyong smartphone ay nag-ulat ng isang error sa koneksyon, subukang huminto at i-restart ang smartphone browser, o kahit na i-restart ang smartphone.\n                                                                                                                             \n3. Ito ay bihira, ngunit, kung ang tunog ay hindi tumugtog, o, pagkatapos nitong tumugtog, walang Proceed button na lilitaw, nangangahulugan ito na nabigo ang pagkakalibrate. Maaari mong subukang muli sa pamamagitan ng pag-refresh ng pahina ng browser na ito: i-tap ang address; i-tap go. Iyan ang kadalasang gumagawa ng lansihin.',
