    kn: 'ವಿವರಣೆ ಈ ಹಂತಕ್ಕಾಗಿ, ಅಗತ್ಯವಿದ್ದರೆ ಹತ್ತಿರ ಸರಿಸಿ, ಆದ್ದರಿಂದ ನೀವು ಪರದೆಯ ಅಗಲಕ್ಕಿಂತ ಎರಡು ಪಟ್ಟು ಹೆಚ್ಚು ದೂರವಿರುವುದಿಲ್ಲ. ಪ್ರತಿ ಕಣ್ಣಿಗೂ ಒಂದು ಬ್ಲೈಂಡ್ ಸ್ಪಾಟ್ ಇರುತ್ತದೆ ಮತ್ತು ನೀವು ಪರದೆಯಿಂದ ಎಷ್ಟು ದೂರದಲ್ಲಿದ್ದೀರಿ ಎಂದು ಅಂದಾಜು ಮಾಡಲು ಈ ಪರೀಕ್ಷೆಯು ನಿಮ್ಮದನ್ನು ಕಂಡುಕೊಳ್ಳುತ್ತದೆ. ಒಂದು ಸಮಯದಲ್ಲಿ ಒಂದು ಕಣ್ಣನ್ನು ಮುಚ್ಚಲು ನಿಮ್ಮನ್ನು ಕೇಳಲಾಗುತ್ತದೆ. ನಿಮ್ಮ ತೆರೆದ ಕಣ್ಣನ್ನು ಶಿಲುಬೆಯ ಮೇಲೆ ಕೇಂದ್ರೀಕರಿಸಿ, ನಿಮ್ಮ ದೃಷ್ಟಿಯ ಮೂಲೆಯಿಂದ ಮಿನುಗುವ ಬಿಂದುವನ್ನು ಗಮನಿಸಿ. ನಿಮ್ಮ ಬ್ಲೈಂಡ್‌ಸ್ಪಾಟ್‌ನಲ್ಲಿ ಡಾಟ್ ಕಣ್ಮರೆಯಾದ ತಕ್ಷಣ RETURN ಒತ್ತಿರಿ.\n\nನಿಮ್ಮ ವೀಕ್ಷಣಾ ದೂರ ಮತ್ತು ಪರದೆಯ ಗಾತ್ರವನ್ನು ಅವಲಂಬಿಸಿ, ಪರದೆಯ ಮಧ್ಯಭಾಗವನ್ನು ತಲುಪುವ ಮೊದಲು ಡಾಟ್ ಸಾಮಾನ್ಯವಾಗಿ ಕಣ್ಮರೆಯಾಗುತ್ತದೆ. ಕೊನೆಯ ಎರಡು ಅಳತೆಗಳು ಒಪ್ಪುವವರೆಗೆ ನೀವು ಎರಡೂ ಕಣ್ಣುಗಳೊಂದಿಗೆ ಪರೀಕ್ಷೆಯನ್ನು ಪುನರಾವರ್ತಿಸುತ್ತೀರಿ, ಪರ್ಯಾಯವಾಗಿ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ತಲೆಯನ್ನು ಸ್ಥಿರವಾಗಿ ಹಿಡಿದುಕೊಳ್ಳಿ ಮತ್ತು ಎಡ-ಬಲ ಜೋಡಿ ಅಳತೆಗಳಿಗಾಗಿ ಪರದೆಯಿಂದ ಅದೇ ಅಂತರವನ್ನು ಇರಿಸಿ..\n\nಗಮನಿಸಿ. ಚುಕ್ಕೆ ಎಂದಿಗೂ ಕಣ್ಮರೆಯಾಗದಿದ್ದರೆ, ಶಿಲುಬೆಯಲ್ಲಿ ಸ್ಥಿರವಾಗಿ ಉಳಿಯುವ ಬದಲು ನಿಮ್ಮ ಕಣ್ಣು ಬಹುಶಃ ಅದನ್ನು ಅನುಸರಿಸುತ್ತಿದೆ. ನಿಮ್ಮ ಬದಿಯ ದೃಷ್ಟಿಯಲ್ಲಿನ ಚುಕ್ಕೆಯನ್ನು ಮಾತ್ರ ಗಮನಿಸುವಾಗ ನಿಮ್ಮ ನೋಟವನ್ನು ಶಿಲುಬೆಯ ಮೇಲೆ ಲಾಕ್ ಮಾಡುವುದು ಕೀಲಿಯಾಗಿದೆ. ಇದು ಮೊದಲಿಗೆ ಟ್ರಿಕಿ ಅನಿಸಬಹುದು ಆದರೆ ಅಭ್ಯಾಸದಿಂದ ಬೇಗನೆ ಸುಲಭವಾಗುತ್ತದೆ.',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: 'PENJELASAN. Untuk langkah ini, bergerak lebih dekat jika perlu, jadi anda tidak lebih jauh daripada dua kali lebar skrin. Setiap mata mempunyai titik buta, dan ujian ini akan menemui anda untuk menganggarkan sejauh mana anda dari skrin. Anda akan diminta untuk menutup sebelah mata pada satu masa. Pastikan mata terbuka anda tertumpu pada salib, sambil melihat titik berkelip di sudut penglihatan anda. Tekan RETURN sebaik sahaja titik itu hilang ke titik buta anda.\n\nBergantung pada jarak tontonan dan saiz skrin anda, titik itu biasanya hilang sebelum mencapai bahagian tengah skrin. Anda akan mengulangi ujian dengan kedua-dua mata, berselang-seli, sehingga dua ukuran terakhir bersetuju. Sila pegang kepala anda dengan stabil dan kekalkan jarak yang sama dari skrin untuk pasangan ukuran kiri-kanan..\n\nNOTA. JIKA TITIK TIDAK PERNAH HILANG, mata anda mungkin mengikutinya dan bukannya terus terpaku pada salib. Kuncinya adalah untuk memastikan pandangan anda terkunci pada salib sambil hanya melihat titik dalam penglihatan sisi anda. Ini mungkin terasa rumit pada mulanya tetapi dengan cepat menjadi lebih mudah dengan latihan.',
    ml: 'Loading...',
    no: 'Loading...',
    fa: 'توضیح. برای این مرحله، در صورت نیاز نزدیک‌تر بیایید تا بیش از دو برابر عرض صفحه فاصله نداشته باشید. هر چشم نقطهٔ کوری دارد. ما نقطهٔ کور شما را پیدا می‌کنیم تا فاصلهٔ چشم شما تا صفحه نمایش را کشف کنیم. از شما خواسته می‌شود یک چشم را ببندید یا بپوشانید تا چشم دیگر را جدا کنیم. در حالی که روی صلیب تمرکز می‌کنید، نقطهٔ چشمک‌زن را با گوشهٔ چشمتان دنبال کنید و زمانی که ناپدید شد، دکمه بازگشت را فشار دهید. بسته به فاصله مشاهده و اندازه صفحه، نقطهٔ چشمک‌زن معمولاً قبل از رسیدن به وسط صفحه به نقطه کور شما می‌رسد. این کار را با هر دو چشم انجام می‌دهید و به‌طور متناوب ادامه می‌دهید تا دو اندازه‌گیری آخر سازگار شوند. لطفاً هنگام آزمایش هر دو چشم فاصله مشاهده خود را حفظ کنید.\n توجه: اگر نقطه هرگز ناپدید نشود، یعنی چشم شما نقطه را دنبال می‌کند، نه اینکه روی صلیب بماند. این آزمون نیاز دارد که چشم شما روی صلیب بماند و در عین حال نقطه چشمک‌زن را از گوشه چشم نظارت کند. این در ابتدا سخت است، اما با تمرین آسان‌تر می‌شود.',
