    ja: '説明。7つのステップがあります。\n1. 長い日常的な物を選びます。長ければ長いほど良いです（画面の幅まで）。定規、本、ボトル、背の高いグラス、ひも、木のスプーン、丸めた紙などが良いでしょう。電話やリモコンでも代用できますが、長い方が簡単です。\n2. 鉛筆などの鋭利なものは避けてください。\n3. 黄色のテープを使って、物の長さを測ります。\n4. 物の左端をテープの左端に合わせます。\n5. ◀ ▶ キーを使うか、ドラッグして、テープの右端を物の右端に移動します。\n6. この測った物を使って、目からコンピューターのカメラまでの距離を設定します。\n7. 頭を動かさずに、カメラがあなたの顔を映すように物を離し、スペースバーを押します。',
