    ml: 'വിശദീകരണം. ഏഴ് പടികൾ ഉണ്ട്. \n1. ദൈർഘ്യമേറിയ ദൈനംദിന ഒബ്‌ജക്റ്റ് തിരഞ്ഞെടുക്കുക - ദൈർഘ്യമേറിയതാണ് നല്ലത് (നിങ്ങളുടെ സ്‌ക്രീനിൻ്റെ വീതി വരെ). നല്ല തിരഞ്ഞെടുപ്പുകൾ: ഒരു ഭരണാധികാരി, പുസ്തകം, കുപ്പി, ഉയരമുള്ള ഗ്ലാസ്, ചരട്, മരം സ്പൂൺ, അല്ലെങ്കിൽ ചുരുട്ടിയ പേപ്പർ. ഒരു ഫോണോ റിമോട്ടോ ഒരു നുള്ളിൽ പ്രവർത്തിക്കും, എന്നാൽ ദൈർഘ്യമേറിയത് എളുപ്പമാണ്.\n2. പെൻസിൽ പോലുള്ള മൂർച്ചയുള്ള വസ്തുക്കൾ ഒഴിവാക്കുക.\n3. നിങ്ങളുടെ വസ്തുവിൻ്റെ നീളം അളക്കാൻ മഞ്ഞ ടേപ്പ് ഉപയോഗിക്കുക. \n4. വസ്തുവിൻ്റെ ഇടത് അറ്റം ടേപ്പിൻ്റെ ഇടത് അറ്റത്ത് വയ്ക്കുക. \n5. ടേപ്പിൻ്റെ വലത് അറ്റം വസ്തുവിൻ്റെ വലത് അറ്റത്തേക്ക് നീക്കാൻ ◀ ▶ അമ്പടയാള കീകൾ ഉപയോഗിക്കുക, അല്ലെങ്കിൽ വലിച്ചിടുക.\n6. നിങ്ങളുടെ കണ്ണിൽ നിന്ന് കമ്പ്യൂട്ടറിൻ്റെ ക്യാമറയിലേക്കുള്ള ദൂരം സജ്ജമാക്കാൻ ഈ അളന്ന വസ്തു ഉപയോഗിക്കുക.\n7. നിങ്ങളുടെ തല നിശ്ചലമാക്കി, ക്യാമറ നിങ്ങളുടെ മുഖം കാണുന്നതിന് ഒബ്‌ജക്റ്റ് നീക്കം ചെയ്യുക, തുടർന്ന് SPACE ബാർ അമർത്തുക',
    no: 'FORKLARING. Det er syv trinn. \n1. Velg en lang hverdagsgjenstand – jo lengre jo bedre (opp til bredden på skjermen). Gode ​​valg: linjal, bok, flaske, høyt glass, hyssing, treskje eller sammenrullet papir. En telefon eller fjernkontroll kan fungere på et blunk, men lenger er enklere.\n2. Unngå skarpe gjenstander som blyanter.\n3. Bruk det gule båndet til å måle objektets lengde. \n4. Plasser objektets venstre ende i båndets venstre ende. \n5. Bruk ◀ ▶ piltastene, eller dra, for å flytte båndets høyre ende til objektets høyre ende.\n6. Bruk dette målte objektet til å stille inn avstanden fra øyet til datamaskinens kamera.\n7. Hold hodet i ro, fjern objektet slik at kameraet ser ansiktet ditt, og trykk deretter på MELLOMROM',
