    pt: 'EXPLICAÇÃO. São sete passos.\n1. Escolha um objeto longo do dia a dia — quanto mais longo, melhor (até a largura da sua tela). Boas opções: uma régua, um livro, uma garrafa, um copo alto, um barbante, uma colher de pau ou papel enrolado. Um telefone ou controle remoto podem funcionar em caso de emergência, mas quanto mais longo, melhor.\n2. Evite objetos pontiagudos, como lápis.\n3. Use a fita amarela para medir o comprimento do seu objeto.\n4. Coloque a extremidade esquerda do objeto na extremidade esquerda da fita.\n5. Use as setas ◀ ▶ ou arraste para mover a extremidade direita da fita para a extremidade direita do objeto.\n6. Use este objeto medido para definir a distância do seu olho até a câmera do computador.\n7. Mantendo a cabeça imóvel, afaste o objeto para que a câmera veja seu rosto e pressione a barra de ESPAÇO.',
