    de: 'Loading...',
    el: 'Loading...',
    he: 'Loading...',
    hi: 'हर बार जब आप क्रॉस को देखते हैं, तो कहीं न कहीं रेखाओं का एक जोड़ा चमकेगा। शायद जहाँ आप देख रहे हैं; शायद आपकी आँख के कोने में। बस एक चमक। इस काम को सीखने के लिए, आइए पहले इसे एक स्थिर डिस्प्ले के साथ आज़माएँ। नीचे दिए गए क्रॉस को बिना आँखें घुमाए देखते हुए: क्या ऊपरी रेखा निचली रेखा के सापेक्ष बाईं या दाईं ओर खिसकी है?\n\n+ |\n|\n\nयह बाईं ओर खिसकी है। यह डिस्प्ले स्थिर है, इसलिए रेखाओं पर अपनी नज़रें घुमाना और बदलाव को पहचानना आसान होगा। लेकिन, एक वास्तविक परीक्षण में, रेखाएँ चमकती हैं, इसलिए आँखें घुमाने का समय नहीं मिलता। हर बार जब आप परीक्षण शुरू करते हैं, तो क्रॉस को देखना ज़रूरी है। रेखाएँ तुरंत चमक जाएँगी। चमकने के बाद आपकी आँखें कहाँ जाती हैं, इससे कोई फ़र्क नहीं पड़ता। परीक्षण का पहला चरण अभ्यास के कुछ प्रयास मात्र हैं, इससे पहले कि हम गंभीरता से शुरुआत करें।',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: 'Loading...',
    ja: 'Loading...',
    kn: 'Loading...',
    ko: '각 시행에서 십자가를 보는 동안 어딘가에서 두 개의 선이 깜빡입니다. 보고 있는 곳일 수도 있고, 눈꼬리일 수도 있습니다. 그저 깜빡일 뿐입니다. 이 작업을 배우기 위해 먼저 정적 디스플레이로 시도해 보겠습니다. 아래 십자가를 눈을 움직이지 않고 보면서: 위쪽 선이 아래쪽 선에 비해 왼쪽이나 오른쪽으로 이동했습니까?\n\n+ |\n|\n\n왼쪽으로 이동했습니다. 이 디스플레이는 정적이므로 눈을 선으로 옮겨 이동을 파악하기 쉽습니다. 하지만 실제 시행에서는 선이 깜빡이기 때문에 눈을 움직일 시간이 없습니다. 각 시행을 시작할 때 십자가를 보는 것이 중요합니다. 선은 즉시 깜빡입니다. 깜빡임 후 눈을 어디로 가져가든 상관없습니다. 첫 번째 테스트 블록은 본격적으로 시작하기 전에 몇 번의 연습 시행입니다.',
    lt: 'Kiekvieno bandymo metu, kai žiūrite į kryžių, kažkur mirksės eilučių pora. Galbūt ten, kur ieškai; gal akies krašteliu. Tiesiog blyksnis. Norėdami išmokti užduotį, pirmiausia išbandykite ją naudodami STATIC ekraną. Žiūrint į kryžių apačioje, nejudindami akių: Ar viršutinė linija pasislinkusi į kairę ar į dešinę, palyginti su apatine linija? \n\n              + |\n                                |\n\nJis perkeltas į kairę. Šis ekranas yra statinis, todėl būtų lengva nukreipti akis į linijas ir pasakyti poslinkį. Tačiau tikrame bandyme linijos mirkčioja, todėl nėra laiko pajudinti akių. Pradedant kiekvieną išbandymą svarbu pažvelgti į kryžių. Linijos iškart mirksi. Nesvarbu, kur krypsta akys po blykstės. Pirmasis bandymų blokas yra tik keli praktikos bandymai, prieš pradedant rimtai.',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: 'در هر آزمون، در حالی که به صلیب نگاه می‌کنید، یک جفت خط در جایی چشمک خواهد زد. شاید جایی که نگاه می‌کنید، شاید در گوشهٔ چشم‌تان. فقط یک فلش. برای یادگیری کار، اجازه دهید ابتدا با یک نمایش ثابت آن را امتحان کنیم. در حالی که به صلیب زیر نگاه می‌کنید، بدون حرکت دادن چشمانتان: آیا خط بالایی نسبت به خط پایینی به چپ یا راست جابه‌جا شده است؟\n \n  + |\n  |\n \n این خط به سمت چپ جابه‌جا شده است. این نمایش ثابت است، بنابراین حرکت دادن چشم به خطوط و تشخیص جابه‌جایی آسان خواهد بود. اما در یک آزمون واقعی، خطوط به صورت فلش ظاهر می‌شوند، بنابراین زمانی برای حرکت دادن چشم وجود ندارد. مهم است که هنگام آغاز هر آزمون به صلیب نگاه کنید. خطوط بلافاصله فلش می‌زنند. مهم نیست چشمان شما بعد از فلش کجا می‌رود. اولین بلوک آزمایش تنها چند آزمون تمرینی است قبل از اینکه به طور جدی شروع کنیم.',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: 'Loading...',
    sw: 'Loading...',
    sv: 'Loading...',
    tl: 'Sa bawat pagsubok, habang tumitingin ka sa krus, isang pares ng mga linya ang mag-FLASH sa isang lugar. Baka kung saan ka tumitingin; baka sa gilid ng mata mo. Isang flash lang. Upang matutunan ang gawain, subukan muna natin ito gamit ang isang STATIC na display. Habang nakatingin sa krus, sa ibaba, nang hindi ginagalaw ang iyong mga mata: Ang itaas na linya ba ay inilipat pakaliwa o pakanan, na may kaugnayan sa ibabang linya? \n\n              + |\n                                |\n\nLumipat ito sa kaliwa. Ang display na ito ay static, kaya magiging madaling ilipat ang iyong mga mata sa mga linya at sabihin ang shift. Ngunit, sa isang tunay na pagsubok, ang mga linya ay FLASHED, kaya walang oras upang ilipat ang iyong mga mata. Mahalagang tingnan ang krus habang sinisimulan mo ang bawat pagsubok. Ang mga linya ay kumikislap kaagad. Hindi mahalaga kung saan pupunta ang iyong mga mata pagkatapos ng flash. Ang unang bloke ng pagsubok ay ilan lamang sa mga pagsubok ng pagsasanay, bago tayo magsimula nang marubdob.',
