    ar: 'في كل تجربة، بينما تنظر إلى الصليب، ستومض ثلاث [[LLS]] عشوائية في زاوية عينك. مجرد ومضة. لتعلم المهمة، دعنا نجربها أولاً مع عرض ثابت. بينما تنظر إلى الصليب أدناه، دون تحريك عينيك: ما هو [[LLL]] الأوسط؟\n                    +.              2 7 3\nإنه 7. هذا العرض ثابت، لذا سيكون من السهل تحريك عينيك إلى [[LLL]] والتعرف عليه. ولكن في التجربة الحقيقية، [[LLL]] يضيء، لذا لا يوجد وقت لتحريك عينيك. من المهم أن تنظر إلى الصليب عند بدء التجربة. سيومض [[LLL]] على الفور. لا يهم أين تذهب عيناك بعد الوميض. الجزء الأول من الاختبار هو مجرد بضع تجارب تدريبية قبل أن نبدأ بشكل جدي. ',
