    bg: 'При всеки опит, докато гледате кръста, триплет от три произволни [[LLS]] ще МИГА в ъгъла на окото ви. Само светкавица. За да научите задачата, нека първо я опитаме със СТАТИЧЕН дисплей. Докато гледате кръста отдолу, без да мърдате очите си: Каква е средата [[LLL]]?\n                    +.              2 7 3\nТова е 7. Този дисплей е статичен, така че ще бъде лесно да преместите очите си към [[LLL]] и да го идентифицирате. Но в реално изпитание [[LLL]] МИГА, така че няма време да мърдате очите си. Важно е да гледате кръста, когато започвате процеса. [[LLL]] ще мига незабавно. Няма значение накъде отиват очите ви след светкавицата. Първият блок от тестване е само няколко опита на практика, преди да започнем сериозно. ',
