    cs: 'Loading...',
    da: 'Loading...',
    nl: 'Bij elke poging, terwijl je naar het kruis kijkt, knippert er een drietal willekeurige [[LLL]] in je ooghoek. Slechts een flits. Om de oefening te leren, proberen we het eerst met een STATISCHE weergave. Kijk naar het kruis hieronder, zonder je ogen te bewegen: Wat is de middelste [[LLL]]?\n+. 2 7 3\nHet is een 7. Deze weergave is statisch, dus het zou gemakkelijk zijn om je ogen naar de [[LLL]] te bewegen en deze te identificeren. Maar in een echte poging knippert de [[LLL]], dus is er geen tijd om je ogen te bewegen. Het is belangrijk om naar het kruis te kijken wanneer je de poging begint. De [[LLL]] knippert onmiddellijk. Het maakt niet uit waar je ogen naartoe gaan na de flits. Het eerste blok testen bestaat uit slechts een paar oefenpogingen, voordat we echt beginnen.',
