    fa: 'در هر آزمون، در حالی که به صلیب نگاه می‌کنید، سه [[LLS]] تصادفی در گوشهٔ چشمتان چشمک خواهند زد. فقط یک فلش. برای یادگیری این کار، اجازه دهید ابتدا با یک نمایش ثابت آن را امتحان کنیم. در حالی که به صلیب زیر نگاه می‌کنید، بدون حرکت دادن چشمانتان: [[LLL]] وسط چیست؟\n                 3 7 2                +.                                                                                                                                                                                                                                                                                         این عدد 7 است. این نمایش ثابت است، بنابراین حرکت دادن چشم به [[LLL]] و شناسایی آن آسان است. اما در یک آزمون واقعی، [[LLL]] به صورت فلش ظاهر می‌شود، بنابراین زمانی برای حرکت دادن چشم وجود ندارد. مهم است که هنگام آغاز آزمون به صلیب نگاه کنید. [[LLL]] بلافاصله فلش می‌زند. مهم نیست چشمان شما بعد از فلش کجا می‌رود. اولین بلوک آزمایش تنها چند آزمون تمرینی است قبل از اینکه به طور جدی شروع کنیم.',
    pl: 'Loading...',
    pt: 'Em cada tentativa, enquanto você olha para a cruz, um trio de três [[LLS]] aleatórios PISCARÁ no canto do seu olho. Apenas um piscar. Para aprender a tarefa, vamos tentar primeiro com uma tela ESTÁTICA. Enquanto olha para a cruz, abaixo, sem mover os olhos: Qual é a [[LLL]] do meio?\n+. 2 7 3\nÉ um 7. Esta tela é estática, então seria fácil mover seus olhos para a [[LLL]] e identificá-la. Mas, em uma tentativa real, a [[LLL]] PISCARÁ, então não há tempo para mover seus olhos. É importante olhar para a cruz ao iniciar a tentativa. A [[LLL]] piscará imediatamente. Não importa para onde seus olhos vão após o flash. O primeiro bloco de testes consiste em apenas algumas tentativas de prática, antes de começarmos de verdade.',
