    fa: 'در هر آزمون، در حالی که به صلیب نگاه می‌کنید، یک رقم تصادفی در گوشهٔ چشمتان چشمک خواهد زد. فقط یک فلش. برای یادگیری کار، اجازه دهید ابتدا با یک نمایش ثابت امتحان کنیم. در حالی که به صلیب زیر نگاه می‌کنید، بدون حرکت دادن چشمانتان: آن رقم چیست؟\n \n + 3 \n \n جواب ۳ است. این نمایش ثابت است، بنابراین حرکت دادن چشم به رقم و تشخیص آن آسان است. اما در یک آزمون واقعی، رقم به صورت فلش ظاهر می‌شود، بنابراین زمانی برای حرکت دادن چشم وجود ندارد. لطفاً هنگام آغاز آزمون به صلیب نگاه کنید. مهم نیست چشمان شما بعد از فلش کجا می‌رود. اولین بلوک آزمایش تنها چند آزمون تمرینی است قبل از اینکه به طور جدی شروع کنیم.',
