    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'La fiecare încercare, în timp ce te uiți la cruce, în colțul ochiului îți va PLIMINĂ o imagine. Doar un fulger. Pentru a învăța sarcina, să o încercăm mai întâi cu afișarea STATIC a unei litere. Privind crucea, dedesubt, fără să-ți miști ochii: Ce literă este?\n\n             +               R  \n\nEste un R. Acest afișaj este static, așa că ar fi ușor să vă mutați ochii către imagine (R) pentru a o identifica. Dar, într-o încercare reală, imaginea este FLASHED, așa că nu ai timp să-ți miști ochii. Vă rugăm să priviți crucea în timp ce începeți procesul. Nu contează unde se duc ochii după bliț. Primul bloc de testare este doar câteva încercări de practică, înainte de a începe serios.',
    ru: 'Loading...',
    sr: 'На сваком суђењу, док гледате у крст, у углу вашег ока трепери слика. Само блиц. Да бисмо научили задатак, покушајмо прво са СТАТИЧНИМ приказом слова. Док гледаш у крст, доле, не мрдајући очима: Које је то слово?\n\n             +               Р  \n\nТо је Р. Овај екран је статичан, тако да би било лако да померите очи на слику (Р) да бисте је идентификовали. Али, у правом суђењу, слика је БЛЕСНУТА, тако да нема времена да померите очи. Молим вас, погледајте крст док започињете суђење. Није важно куда ће вам очи отићи након бљеска. Први блок тестирања је само неколико покушаја у пракси, пре него што почнемо озбиљно.',
    es: 'Loading...',
    sw: 'Loading...',
    sv: 'Vid varje försök, medan du tittar på korset, BLINKAR en bild i ögonvrån. Bara en blixt. För att lära oss uppgiften, låt oss prova den först med en STATISK visning av en bokstav. Medan du tittar på korset, nedanför, utan att röra ögonen: Vilken bokstav är det?\n\n             +               R  \n\nDet är ett R. Den här displayen är statisk, så det skulle vara lätt att flytta ögonen till bilden (R) för att identifiera den. Men i en riktig prövning blinkar bilden, så det finns ingen tid att röra ögonen. Titta på korset när du inleder rättegången. Det spelar ingen roll vart dina ögon tar vägen efter blixten. Det första testblocket är bara några övningar innan vi börjar på allvar.',
